CREATE OR REPLACE FUNCTION dateToUtc(theDate IN DATE)
RETURN TIMESTAMP
IS
  utcDate TIMESTAMP;
BEGIN
  SELECT SYS_EXTRACT_UTC(cast(theDate as timestamp))
  INTO utcDate
  FROM dual;

  RETURN utcDate;
END dateToUtc;
/



