DECLARE
	globalErrorCount integer := 0;

	/*
	 * Display an error line.
	 */
	procedure displayErrorLine(line IN STRING) IS
	begin
		dbms_output.put_line(' * ' || line);
	end;

		/*
	 * Display an error line.
	 */
	procedure displayCorrectionLine(theType IN STRING, theTable IN STRING, line IN STRING) IS
	begin
		displayErrorLine('[' || theType || '] ' || theTable || ' : ' || line);
	end;
	
	/*
	 * Display an error separator into a block.
	 */
	procedure displayErrorSeparator IS
	begin
		dbms_output.put_line(' *' || rpad(' ', 100, '-') || ' * ');
	end;

		/*
	 * Display an error separator into a block.
	 */
	procedure displaySeparator IS
	begin
		dbms_output.put_line(' *' || rpad(' ', 100, '.') || ' * ');
	end;
	
	/*
	 * Display an error separator between blocks.
	 */
	procedure displayErrorFirstSeparator IS
	begin
		dbms_output.put_line('/*' || rpad(' ', 100, '*') || ' */');
	end;

	/*
	 * Display the formatted block title.
	 */
	procedure displayErrorTitle(title IN STRING) IS
	begin
		displayErrorFirstSeparator();
		displayErrorLine('********* ' || rpad(title, 79) || ' ********* *');
		displayErrorFirstSeparator();
	end;
	
	/*
	 * Display the formatted block subtitle.
	 */
	procedure displayErrorSubtitle(title IN STRING) IS
	begin
		displayErrorSeparator();
		displayErrorLine('---- ' || rpad(title, 94) || ' *');
		displaySeparator();
	end;

	/*
	 * Display and format an error with the object ID and the message.
	 */
	procedure displayErrorRow(objectId IN varchar2, colname IN VARCHAR2, message IN VARCHAR2) IS
	begin
		globalErrorCount := globalErrorCount + 1;
		displayErrorLine('Error ' || lpad(globalErrorCount, 3) || ' : ' || message || ' - ' || colname || '[' || objectId || ']');
	end;

	/*
	 * Display a sumup of all previous errors.
	 */
	procedure displayErrorsSumUp IS
	begin
		displayErrorSeparator();
		displayErrorSeparator();
		If globalErrorCount = 0 Then
			displayErrorLine('          :-D OK -> No errors found.');
		Else
			displayErrorLine('          /!\ KO -> ' || globalErrorCount || ' errors found !!!');
		End if;
		displayErrorFirstSeparator();
	end;

	/*
	 * Check errors from a query.
	 *   - The query must return only 1 field (The ID of objects in error)
	 *   - The message is the error description
	 */
	procedure CheckErrorsInQuery( p_query IN varchar2, p_message IN varchar2 )
	IS
		l_theCursor     integer DEFAULT dbms_sql.open_cursor;
		l_columnValue   varchar2(4000);
		l_status        integer;
		l_descTbl       dbms_sql.desc_tab;
		l_colCnt        number;
	begin
		dbms_sql.parse( l_theCursor, p_query, dbms_sql.native );
		dbms_sql.describe_columns( l_theCursor, l_colCnt, l_descTbl );

		FOR i IN 1 .. l_colCnt loop
			dbms_sql.define_column(l_theCursor, i, l_columnValue, 4000);
		end loop;

		l_status := dbms_sql.execute(l_theCursor);

		while ( dbms_sql.fetch_rows(l_theCursor) > 0 ) loop
			dbms_sql.column_value( l_theCursor, 1, l_columnValue );
			displayErrorRow( l_columnValue, l_descTbl(1).col_name, p_message );
		end loop;
    
		dbms_sql.close_cursor(l_theCursor);
	end;


BEGIN
Begin
	displayErrorTitle('Automatic correction of data ...');
END;


Declare

	objectId integer;

	-- platform
	Cursor platformCursor Is
		SELECT DISTINCT ID 
		FROM ko2qta06 ta06
		WHERE NOT EXISTS ( SELECT 1 FROM Ko2qta08 ta08 WHERE ta08.ID = ta06.ID )
		AND ta06.contract_relationship_type = 'PC'
		ORDER BY 1
	;
	
	-- manufacturer
	Cursor manufacturerCursor Is
		SELECT DISTINCT ID 
		FROM ko2qta06 ta06
		WHERE NOT EXISTS ( SELECT 1 FROM Ko2qta20 ta20 WHERE ta20.ID = ta06.ID )
		AND ta06.contract_relationship_type = 'MC'
		ORDER BY 1
	;
	
	-- balancing
	Cursor balancingCursor Is
		SELECT DISTINCT ID 
		FROM ko2qta06 ta06
		WHERE NOT EXISTS ( SELECT 1 FROM ko2qta07 ta07 WHERE ta07.ID = ta06.ID )
		AND ta06.contract_relationship_type = 'TC'
		ORDER BY 1
	;

	-- PartsListFlowBelonging
	Cursor PartsListFlowBelongings Is
		SELECT DISTINCT ID
		FROM ko2qtf01 tf01
		WHERE NOT EXISTS ( SELECT 1 FROM ko2qtf03 tf03 WHERE tf03.partslistflow_id = tf01.ID )
		ORDER BY 1
	;
	
	-- PartListFlow without PartFlow : 
	--    TF01.DT_END_NFC_USED -> null
	Cursor PLFWithoutPFDates Is
		SELECT DISTINCT TF01.ID
		FROM KO2QTF01 TF01
		WHERE NOT EXISTS ( SELECT 1 FROM KO2QTF60 TF60 WHERE TF60.PARTSLISTFLOW_ID = TF01.ID )
		AND TF01.DT_END_NFC_USED IS NOT NULL
		ORDER BY 1
	;
	
	-- ProductExternalPlace for PartListFlow without PartFlow :
	--    TP50.BUILD_OUT_COMMITMENT_DATE -> null
	--    TP50.LOGISTIC_BUILD_OUT_DATE -> null
	Cursor PEPDatesForPLFWithoutPF Is
		SELECT DISTINCT TP50.ID
		FROM (
		  SELECT TF01.ID, TF01.DT_END_NFC_USED, TF01.CONSUMER_SGR_CODE, TF01.ARTICLE_ID
		  FROM KO2QTF01 TF01
		  WHERE NOT EXISTS ( SELECT 1 FROM KO2QTF60 TF60 WHERE TF60.PARTSLISTFLOW_ID = TF01.ID )
		) PLFWITHOUTFP
		JOIN KO2QTT02 TT02S ON (TT02S.CODE = PLFWITHOUTFP.CONSUMER_SGR_CODE)
		JOIN KO2QTT02 TT02C ON (TT02C.CODE = TT02S.CU)
		JOIN KO2QTF02 TF02  ON (TF02.ID = PLFWITHOUTFP.ARTICLE_ID)
		JOIN KO2QTP50 TP50  ON (TP50.PRODUCT_ID = TF02.PRODUCT_ID AND TP50.EXTERNAL_PLACE_ID = TT02C.EXTERNAL_PLACE)
		WHERE TP50.BUILD_OUT_COMMITMENT_DATE IS NOT NULL OR TP50.LOGISTIC_BUILD_OUT_DATE IS NOT NULL
		ORDER BY 1
	;
	
	-- Compute and update BUILD_OUT_COMMITMENT_DATE 
	CURSOR builtOutCommitmentDate IS 
		SELECT p50.id, p50.logistic_build_out_date - NUMTODSINTERVAL(t02.built_out_max_horizon, 'DAY') as COMMITMENT_DATE
		FROM ko2qtp50 p50
		JOIN ko2qtt02 t02 ON t02.external_place = p50.external_place_id
		WHERE p50.logistic_build_out_date IS NOT NULL
		AND t02.built_out_max_horizon IS NOT NULL
		AND (BUILD_OUT_COMMITMENT_DATE IS NULL OR BUILD_OUT_COMMITMENT_DATE <> p50.logistic_build_out_date - NUMTODSINTERVAL(t02.built_out_max_horizon, 'DAY'))
		ORDER BY 1
	FOR UPDATE OF p50.BUILD_OUT_COMMITMENT_DATE;
 
	builtOutCommitmentDateRecord builtOutCommitmentDate%rowtype;
	
	-- Affect undeterminated lines on Order Systems
	CURSOR orderSystemsLine IS
		SELECT f42.order_system_id, t01.id_internal_place
		FROM ko2qtf42 f42
		JOIN ko2qtt19 t19 ON (t19.organisation_id = f42.sgr_id)
		JOIN ko2qtt01 t01 ON (t01.id_internal_place = t19.internal_place_id AND t01.type_of = 'LINE' AND t01.code = 1)
		WHERE f42.line_id IS NULL
		ORDER BY 1
	FOR UPDATE OF F42.line_id;
	
	orderSystemsLineRecord orderSystemsLine%rowtype;
	
	-- Affect undeterminated lines on external place product parameters
	CURSOR PEPParametersLine IS
		SELECT p53.id, t01.id_internal_place
		FROM ko2qtp53 p53
		JOIN ko2qtt19 t19 ON (t19.organisation_id = p53.sgr)
		JOIN ko2qtt01 t01 ON (t01.id_internal_place = t19.internal_place_id AND t01.type_of = 'LINE' AND t01.code = 1)
		WHERE p53.line IS NULL
		ORDER BY 1
	FOR UPDATE OF p53.line;
	
	PEPParametersLineRecord PEPParametersLine%rowtype;
	
Begin

  -- Plateform
  displayErrorSubtitle('Plateform (KO2QTA08)');
  open platformCursor;
  Loop
    fetch platformCursor into objectId;
    exit when platformCursor%notfound;
    if objectId is not null then
		displayCorrectionLine('I', 'KO2QTA08', 'ID=' || objectId || ' , MAX_TIMESLOT=' || 10 );
    end if;
  End Loop;
  Close platformCursor;
  
  -- Manufacturer
  displayErrorSubtitle('Manufacturer (KO2QTA20)');
  open manufacturerCursor;
  Loop
    fetch manufacturerCursor into objectId;
    exit when manufacturerCursor%notfound;
    if objectId is not null then
		displayCorrectionLine('I', 'KO2QTA20', 'ID=' || objectId || ' , CUTTING_FORECAST_MODE=' || 'WEEKLY_ROLLING' || ' , CORRECT_LABELS=' || 0 );
    end if;
  End Loop;
  Close manufacturerCursor;
  
  -- Balancing
  displayErrorSubtitle('Balancing (KO2QTA07, KO2QTA17)');
  open balancingCursor;
  Loop
    fetch balancingCursor into objectId;
    exit when balancingCursor%notfound;
    if objectId is not null then
		displayCorrectionLine('I', 'KO2QTA07', 'ID=' || objectId || ' , HORIZON_OF_BALANCING=' || 50 || ' , PLATFORM_INDEX_BALANCING_TC=' || 'N' || ' , MIN_VOL_OF_TIMESLOT_CREATION=' || 1 || ' , VOL_PER_TIMESLOT=' || 2 || ' , WEEKLY_CALCUL_DAY=' || 'MONDAY' );
		displayCorrectionLine('I', 'KO2QTA17', 'ID=' || objectId || ' , START_DATE=' || '01/01/2011' || ' , END_DATE=null , VALUE=' || 321 || ' , LISSAGE_PARAMETERS=' || objectId );
    end if;
  End Loop;
  Close balancingCursor;
  
  -- PartsListFlowBelonging
  displayErrorSubtitle('PartsListFlowBelonging (KO2QTF03)');
  open PartsListFlowBelongings;
  Loop
    fetch PartsListFlowBelongings into objectId;
    exit when PartsListFlowBelongings%notfound;
    if objectId is not null then
		displayCorrectionLine('I', 'KO2QTF03', 'ID=' || objectId || ' , PARTSLISTFLOW_ID=' || objectId || ' , CD_BELONGING=' || '771PTM' || ' , DT_START_USE=' || '01/01/2012' || ' , DT_END_USE=' || '31/12/2024' );
    end if;
  End Loop;
  Close PartsListFlowBelongings;
  
  -- PartListFlow Without PartFlow
  displayErrorSubtitle('PartListFlow Without PartFlow (KO2QTF01)');
  open PLFWithoutPFDates;
  Loop
    fetch PLFWithoutPFDates into objectId;
    exit when PLFWithoutPFDates%notfound;
    if objectId is not null then
		displayCorrectionLine('U', 'KO2QTF01', 'ID=' || objectId || ' , DT_END_NFC_USED=null' );
		UPDATE KO2QTF01 SET DT_END_NFC_USED = null WHERE ID = objectId;
    end if;
  End Loop;
  Close PLFWithoutPFDates;
  
  -- ProductExternalPlace on PartListFlow without PartFlow :
  displayErrorSubtitle('ProductExternalPlace with PartListFlow Without PartFlow (KO2QTP50)');
  open PEPDatesForPLFWithoutPF;
  Loop
    fetch PEPDatesForPLFWithoutPF into objectId;
    exit when PEPDatesForPLFWithoutPF%notfound;
    if objectId is not null then
		displayCorrectionLine('U', 'KO2QTP50', 'ID=' || objectId || ' , BUILD_OUT_COMMITMENT_DATE=null , LOGISTIC_BUILD_OUT_DATE=null' );
		UPDATE KO2QTP50 SET BUILD_OUT_COMMITMENT_DATE = null , LOGISTIC_BUILD_OUT_DATE = null WHERE ID = objectId;
    end if;
  End Loop;
  Close PEPDatesForPLFWithoutPF;
  
  -- BuildOutCommitmentDate
  displayErrorSubtitle('BuildOutCommitmentDate with incorrect value (KO2QTP50)');
  FOR builtOutCommitmentDateRecord in builtOutCommitmentDate loop
	displayCorrectionLine('U', 'KO2QTP50', 'ID=' || builtOutCommitmentDateRecord.id || ' , BUILD_OUT_COMMITMENT_DATE=' || builtOutCommitmentDateRecord.COMMITMENT_DATE );
    update ko2qtp50 set BUILD_OUT_COMMITMENT_DATE = builtOutCommitmentDateRecord.COMMITMENT_DATE
    where current of builtOutCommitmentDate;
  END loop;
  
  -- Affect undeterminated lines on Order Systems
  displayErrorSubtitle('Missing lines on order systems (KO2QTF42)');
  FOR orderSystemsLineRecord in orderSystemsLine loop
	displayCorrectionLine('U', 'KO2QTF42', 'ORDER_SYSTSEM_ID=' || orderSystemsLineRecord.order_system_id || ' , LINE_ID=' || orderSystemsLineRecord.id_internal_place );
    update ko2qtf42 set LINE_ID = orderSystemsLineRecord.id_internal_place
    where current of orderSystemsLine;
  END loop;
  
    -- Affect undeterminated lines on external places product
  displayErrorSubtitle('Missing lines on external place product (KO2QTP53)');
  FOR PEPParametersLineRecord in PEPParametersLine loop
	displayCorrectionLine('U', 'KO2QTP53', 'ID=' || PEPParametersLineRecord.ID || ' , ID=' || PEPParametersLineRecord.id_internal_place );
    update ko2qtp53 set LINE = PEPParametersLineRecord.id_internal_place
    where current of PEPParametersLine;
  END loop;

