DECLARE 
	
   buildOutLetterInformation VARCHAR2(10000) := '
    SELECT ko2qnf80.nextval, req.* FROM (
      SELECT f40.partflow_id, ''INFORMATION'' as build_out_letter_type, p50.logistic_build_out_date - NUMTODSINTERVAL(t02.built_out_max_horizon, ''DAY'') as build_out_letter_date
      FROM ko2qtf40 f40
      LEFT JOIN ko2qtf80 f80 ON (f80.part_flow = f40.partflow_id AND f80.build_out_letter_type = ''INFORMATION'')
      JOIN ko2qtp50 p50 ON (p50.ID = f40.product_external_place AND (p50.logistic_build_out_date IS NOT NULL AND p50.logistic_build_out_date > SYSDATE))
      JOIN ko2qtt02 t02 ON (t02.external_place = p50.external_place_id)
      WHERE f80.build_out_letter_type IS NULL
      AND t02.built_out_max_horizon IS NOT NULL
      GROUP BY f40.partflow_id, p50.logistic_build_out_date, t02.built_out_max_horizon
      ORDER BY 1
    ) req
  ';
  
  buildOutLetterReminder VARCHAR2(10000) := '
    SELECT ko2qnf80.nextval, req.* FROM (
      SELECT f40.partflow_id, ''REMINDER'' as build_out_letter_type, p50.logistic_build_out_date - INTERVAL ''120'' DAY(4) as build_out_letter_date
      FROM ko2qtf40 f40
      LEFT JOIN ko2qtf80 f80 ON (f80.part_flow = f40.partflow_id AND f80.build_out_letter_type = ''REMINDER'')
      JOIN ko2qtp50 p50 ON (p50.ID = f40.product_external_place AND (p50.logistic_build_out_date IS NOT NULL AND p50.logistic_build_out_date > SYSDATE))
      WHERE f80.build_out_letter_type IS NULL
      GROUP BY f40.partflow_id, p50.logistic_build_out_date
      ORDER BY 1
    ) req
  ';
  
  buildOutLetterConfirmation VARCHAR2(10000) := '
    SELECT ko2qnf80.nextval, req.* FROM (
      SELECT f40.partflow_id, ''CONFIRMATION'' as build_out_letter_type, p50.logistic_build_out_date - INTERVAL ''30'' DAY(4) as build_out_letter_date
      FROM ko2qtf40 f40
      LEFT JOIN ko2qtf80 f80 ON (f80.part_flow = f40.partflow_id AND f80.build_out_letter_type = ''CONFIRMATION'')
      JOIN ko2qtp50 p50 ON (p50.ID = f40.product_external_place AND (p50.logistic_build_out_date IS NOT NULL AND p50.logistic_build_out_date > SYSDATE))
      WHERE f80.build_out_letter_type IS NULL
      GROUP BY f40.partflow_id, p50.logistic_build_out_date
      ORDER BY 1
    ) req
  ';
  
	TYPE BUILD_OUT_LETTER_TYPE IS RECORD (
		ID					            ko2qtf80.ID%TYPE,
		part_flow			          ko2qtf80.part_flow%TYPE,
		build_out_letter_type	  ko2qtf80.build_out_letter_type%type,
		build_out_letter_date	  ko2qtf80.build_out_letter_date%type
	);

	TYPE BUILD_OUT_LETTER_ARRAY IS VARRAY(10000) OF BUILD_OUT_LETTER_TYPE;
	
	buildOutLetterList BUILD_OUT_LETTER_ARRAY := BUILD_OUT_LETTER_ARRAY();

	/*
	 * Retrieve BuildOutLetters from a query.
	 */
	PROCEDURE CheckBuildOutLetters(p_query IN VARCHAR2)
	IS
    TYPE curtype IS REF CURSOR;
    l_src_cur curtype;
    l_thecursor	INTEGER DEFAULT dbms_sql.open_cursor;
    l_buildOutLetterList BUILD_OUT_LETTER_ARRAY := BUILD_OUT_LETTER_ARRAY();
	BEGIN
    OPEN l_src_cur FOR p_query;
    FETCH l_src_cur BULK COLLECT INTO l_buildOutLetterList;

    FOR i IN 1 .. l_buildOutLetterList.COUNT LOOP
      buildOutLetterList.EXTEND;
      buildOutLetterList(buildOutLetterList.count) := l_buildOutLetterList(i);
    END LOOP;

    CLOSE l_src_cur;
	END;
  
  /*
	 * Repair build out letters
	 */
	PROCEDURE RepairBuiltOutLetters(p_miList IN BUILD_OUT_LETTER_ARRAY)
	IS
		buildOutLetter BUILD_OUT_LETTER_TYPE;
	BEGIN
		displayErrorSubtitle('Built out letters (KO2QTF80)');
		FOR i IN 1 .. p_miList.COUNT LOOP
			buildOutLetter := p_miList(i);
			
      displayCorrectionLine('I', ' KO2QTF80', 'id='|| buildOutLetter.ID || ' , partflow='|| buildOutLetter.part_flow || ' , build_out_letter_type=' ||buildOutLetter.build_out_letter_type || ' , build_out_letter_date=' ||buildOutLetter.build_out_letter_date);
		END LOOP;
	END;

BEGIN

	CheckBuildOutLetters(buildOutLetterInformation);
  
	CheckBuildOutLetters(buildOutLetterReminder);

	CheckBuildOutLetters(buildOutLetterConfirmation);
	
	RepairBuiltOutLetters(buildOutLetterList);

END;




BEGIN
  FOR THE_TABLE IN (SELECT TABLE_NAME FROM USER_TABLES WHERE TABLE_NAME LIKE 'KO2%' AND TABLE_NAME NOT LIKE 'KO2RTZ01' ORDER BY 1)
  LOOP 
    EXECUTE IMMEDIATE 'UPDATE '||THE_TABLE.TABLE_NAME||' SET CREATION_USER = ''generator'', CREATION_DATE = sysdate, LAST_UPDATE_USER = null, LAST_UPDATE_DATE = null';
  END LOOP;
  
  FOR THE_SEQUENCE IN (SELECT SEQUENCE_NAME FROM USER_SEQUENCES WHERE SEQUENCE_NAME LIKE 'KO2%' ORDER BY 1)
  LOOP 
    EXECUTE IMMEDIATE 'DROP SEQUENCE '||THE_SEQUENCE.SEQUENCE_NAME;
    EXECUTE IMMEDIATE 'CREATE SEQUENCE '||THE_SEQUENCE.SEQUENCE_NAME||' START WITH 300000 INCREMENT BY 1 MAXVALUE 999999999999999999999999999 MINVALUE 300000 NOCACHE';
  END LOOP;
END;


Begin
	displayErrorFirstSeparator();
END;


