CREATE GLOBAL TEMPORARY TABLE tmp_table (
  partflow_id					      NUMBER(19,0),
  maturity_indicator			  NUMBER(19,0),
  indicator_expected_value	CHAR(1 CHAR),
  indicator_value				    CHAR(1 CHAR),
  partflow_current_status   CHAR(1 CHAR),
  partflow_expected_status  CHAR(1 CHAR)
) ON COMMIT PRESERVE ROWS;


DECLARE
	globalErrorCount integer := 0;

	/*
	 * Display an error line.
	 */
	procedure displayErrorLine(line IN STRING) IS
	begin
		dbms_output.put_line(' * ' || line);
	end;

		/*
	 * Display an error line.
	 */
	procedure displayCorrectionLine(theType IN STRING, theTable IN STRING, line IN STRING) IS
	begin
		displayErrorLine('[' || theType || '] ' || theTable || ' : ' || line);
	end;
	
	/*
	 * Display an error separator into a block.
	 */
	procedure displayErrorSeparator IS
	begin
		dbms_output.put_line(' *' || rpad(' ', 100, '-') || ' * ');
	end;

		/*
	 * Display an error separator into a block.
	 */
	procedure displaySeparator IS
	begin
		dbms_output.put_line(' *' || rpad(' ', 100, '.') || ' * ');
	end;
	
	/*
	 * Display an error separator between blocks.
	 */
	procedure displayErrorFirstSeparator IS
	begin
		dbms_output.put_line('/*' || rpad(' ', 100, '*') || ' */');
	end;

	/*
	 * Display the formatted block title.
	 */
	procedure displayErrorTitle(title IN STRING) IS
	begin
		displayErrorFirstSeparator();
		displayErrorLine('********* ' || rpad(title, 79) || ' ********* *');
		displayErrorFirstSeparator();
	end;
	
	/*
	 * Display the formatted block subtitle.
	 */
	procedure displayErrorSubtitle(title IN STRING) IS
	begin
		displayErrorSeparator();
		displayErrorLine('---- ' || rpad(title, 94) || ' *');
		displaySeparator();
	end;

	/*
	 * Display and format an error with the object ID and the message.
	 */
	procedure displayErrorRow(objectId IN varchar2, colname IN VARCHAR2, message IN VARCHAR2) IS
	begin
		globalErrorCount := globalErrorCount + 1;
		displayErrorLine('Error ' || lpad(globalErrorCount, 3) || ' : ' || message || ' - ' || colname || '[' || objectId || ']');
	end;

	/*
	 * Display a sumup of all previous errors.
	 */
	procedure displayErrorsSumUp IS
	begin
		displayErrorSeparator();
		displayErrorSeparator();
		If globalErrorCount = 0 Then
			displayErrorLine('          :-D OK -> No errors found.');
		Else
			displayErrorLine('          /!\ KO -> ' || globalErrorCount || ' errors found !!!');
		End if;
		displayErrorFirstSeparator();
	end;

	/*
	 * Check errors from a query.
	 *   - The query must return only 1 field (The ID of objects in error)
	 *   - The message is the error description
	 */
	procedure CheckErrorsInQuery( p_query IN varchar2, p_message IN varchar2 )
	IS
		l_theCursor     integer DEFAULT dbms_sql.open_cursor;
		l_columnValue   varchar2(4000);
		l_status        integer;
		l_descTbl       dbms_sql.desc_tab;
		l_colCnt        number;
	begin
		dbms_sql.parse( l_theCursor, p_query, dbms_sql.native );
		dbms_sql.describe_columns( l_theCursor, l_colCnt, l_descTbl );

		FOR i IN 1 .. l_colCnt loop
			dbms_sql.define_column(l_theCursor, i, l_columnValue, 4000);
		end loop;

		l_status := dbms_sql.execute(l_theCursor);

		while ( dbms_sql.fetch_rows(l_theCursor) > 0 ) loop
			dbms_sql.column_value( l_theCursor, 1, l_columnValue );
			displayErrorRow( l_columnValue, l_descTbl(1).col_name, p_message );
		end loop;
    
		dbms_sql.close_cursor(l_theCursor);
	end;


BEGIN
Begin
	displayErrorTitle('Automatic correction of data ...');
END;


DECLARE

	--  1 - FLUX PIECE SANS NOMINAL UC
	nominalucindicator VARCHAR2(10000) := '
			SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 1) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM (
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'')
			) REQPF
			LEFT JOIN (
				-- From packing
				SELECT L00.PARTFLOW_ID, CASE WHEN COUNT(1) >= 1 THEN 1 ELSE 0 END AS INDICATOR_EXPECTED_VALUE 
				FROM KO2QTL00 L00
				WHERE L00.PARTFLOW_ID IS NOT NULL GROUP BY L00.PARTFLOW_ID
			) REQEX ON (REQEX.PARTFLOW_ID = REQPF.PARTFLOW_ID)
			LEFT JOIN (
				-- From maturity indicators
				SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				FROM KO2QTF71
				WHERE MATURITY_INDICATOR = 1
			) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	--  2 - FLUX PIECE SANS OPERATIONAL UA MATURE
	operationaluaindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 2) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM (
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'')
			) REQPF
			LEFT JOIN (
				-- From packing
				SELECT L00.PARTFLOW_ID, CASE WHEN COUNT(1) >= 1 THEN 1 ELSE 0 END AS INDICATOR_EXPECTED_VALUE 
				FROM KO2QTL00 L00
				JOIN KO2QTL02 L02 ON (L02.PARTFLOW_PACKING_ID = L00.ID AND L02.CLASS_NAME = ''OperationalUa'' AND L02.VALIDATED = ''1'')
				GROUP BY L00.PARTFLOW_ID
			) REQEX ON (REQEX.PARTFLOW_ID = REQPF.PARTFLOW_ID)
			LEFT JOIN (
				-- From maturity indicators
				SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				FROM KO2QTF71
				WHERE MATURITY_INDICATOR = 2
			) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	--  3 - FLUX PIECE SANS FLUX TRANSPORT
	transportpathsindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 3) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM ( 
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'')
		  ) REQPF
		  LEFT JOIN
		  (
			-- par les flux de transport
			SELECT D02.PARTFLOW AS PF_ID_EX, CASE WHEN COUNT(D02.PARTFLOW) >= 1 THEN 1 ELSE 0 END AS INDICATOR_EXPECTED_VALUE
			FROM KO2QTD02 D02
			GROUP BY D02.PARTFLOW
		  ) REQEX ON (REQPF.PARTFLOW_ID = REQEX.PF_ID_EX)
		  LEFT JOIN
		  (
			-- par les indicateurs de maturite
			SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
			FROM KO2QTF71
			WHERE MATURITY_INDICATOR = 3
		  ) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';

	-- 6 - FLUX PIECE AVEC CHEMIN DE TRANSPORT SANS PARAMETRE DE DELAIS GLOBAUX
	globalleadtimeindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT PARTFLOW, MATURITY_INDICATOR, CASE WHEN SUM(INDICATOR_EXPECTED_VALUE) >= 1 THEN 1 ELSE 0 END as INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
			FROM (
				SELECT REQPF.PARTFLOW, COALESCE(REQMI.MATURITY_INDICATOR, 6) as MATURITY_INDICATOR, REQEX.INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
				FROM (
				  -- Only COMPLET transport paths
				  SELECT PARTFLOW, TRANSPORTPATH
				  FROM KO2QTD02 D02C
				  WHERE CLASSNAME = ''COMPLET''
				  AND (D02C.ENDDATE IS NULL OR D02C.ENDDATE > SYSDATE)
				) REQPF
				LEFT JOIN (
				  -- From parameters
				  SELECT D02.TRANSPORTPATH, 
					 (SELECT CASE WHEN COUNT(1) >= 1 THEN 1 ELSE 0 END FROM KO2QTD10 D10 WHERE D10.TRANSPORT_PATH = D02.TRANSPORTPATH AND D10.DISCR = ''GLB_LEAD_TIME_APPRO'' GROUP BY D02.TRANSPORTPATH) as INDICATOR_EXPECTED_VALUE
				  FROM KO2QTD02 D02 
				) REQEX ON (REQEX.TRANSPORTPATH = REQPF.TRANSPORTPATH)
				LEFT JOIN (
				  -- From maturity indicators
				  SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				  FROM KO2QTF71
				  WHERE MATURITY_INDICATOR = 6
				) REQMI ON (REQPF.PARTFLOW = REQMI.PF_ID_MI)
			)
			GROUP BY PARTFLOW, MATURITY_INDICATOR, INDICATOR_VALUE
		)
		GROUP BY PARTFLOW, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';

	-- 7 - FLUX PIECE AVEC CHEMIN DE TRANSPORT SANS PARAMETRE DE DELAIS
	leadtimeindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT PARTFLOW, MATURITY_INDICATOR, CASE WHEN SUM(INDICATOR_EXPECTED_VALUE) >= 1 THEN 1 ELSE 0 END as INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
			FROM (
				SELECT REQPF.PARTFLOW, COALESCE(REQMI.MATURITY_INDICATOR, 7) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
				FROM (
					-- Only COMPLET transport paths
					SELECT PARTFLOW, TRANSPORTPATH
					FROM KO2QTD02 D02C
					WHERE CLASSNAME = ''COMPLET''
					AND (D02C.ENDDATE IS NULL OR D02C.ENDDATE > SYSDATE)
				) REQPF
				LEFT JOIN (
				  -- From parameters
				  SELECT TRANSPORTPATH, 
						 (SELECT CASE WHEN COUNT(1) >= 1 THEN 1 ELSE 0 END FROM KO2QTD10 D10 WHERE D10.TRANSPORT_PATH = D02.TRANSPORTPATH AND D10.DISCR = ''LEAD_TIME_APPRO'' GROUP BY D02.TRANSPORTPATH) as INDICATOR_EXPECTED_VALUE
				  FROM KO2QTD02 D02 
				) REQEX ON (REQEX.TRANSPORTPATH = REQPF.TRANSPORTPATH)
				LEFT JOIN (
				  -- From maturity indicators
				  SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				  FROM KO2QTF71
				  WHERE MATURITY_INDICATOR = 7
				) REQMI ON (REQPF.PARTFLOW = REQMI.PF_ID_MI)
			)
			GROUP BY PARTFLOW, MATURITY_INDICATOR, INDICATOR_VALUE
		)
		GROUP BY PARTFLOW, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	-- 8 - FLUX PIECE SANS SYSTEM D'ORDRE
	ordersystemindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 8) AS MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) AS INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM (
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'')
			) REQPF
			LEFT JOIN (
				-- From order system
				SELECT F42.PART_FLOW_ID, CASE WHEN COUNT(1) >= 1 THEN 1 ELSE 0 END AS INDICATOR_EXPECTED_VALUE 
				FROM KO2QTF42 F42
				GROUP BY F42.PART_FLOW_ID
			) REQEX ON (REQEX.PART_FLOW_ID = REQPF.PARTFLOW_ID)
			LEFT JOIN (
				-- From maturity indicators
				SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				FROM KO2QTF71
				WHERE MATURITY_INDICATOR = 8
			) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	-- 9 - POURCENTAGE DE REPARTITION LOGISTIQUE
	repartitionpercentageindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 9) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM (
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'')
			) REQPF
			LEFT JOIN (
				-- From repartition percentage
				SELECT PARTFLOW_ID, CASE WHEN COUNT(1) >= 1 THEN 1 ELSE 0 END AS INDICATOR_EXPECTED_VALUE FROM KO2QTF41 F41 WHERE ROLE = ''ACTIVE'' GROUP BY F41.PARTFLOW_ID
			) REQEX ON (REQEX.PARTFLOW_ID = REQPF.PARTFLOW_ID)
			LEFT JOIN (
				-- From maturity indicators
				SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				FROM KO2QTF71
				WHERE MATURITY_INDICATOR = 9
			) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	-- 10 - COMMANDES
	purchaseorderindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 10) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM (
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'')
				AND F40.NEXT_PARTFLOW IS NULL
			) REQPF
			LEFT JOIN (
				-- From purchase order
				SELECT PARTFLOW_ID, CASE WHEN COUNT(1) >= 1 THEN 1 ELSE 0 END AS INDICATOR_EXPECTED_VALUE FROM KO2QTC01 C01 GROUP BY C01.PARTFLOW_ID
			) REQEX ON (REQEX.PARTFLOW_ID = REQPF.PARTFLOW_ID)
			LEFT JOIN (
				-- From maturity indicators
				SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				FROM KO2QTF71
				WHERE MATURITY_INDICATOR = 10
			) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	-- 11 - INCOTERM TRANSPORT CONDITIONS
	incotermindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 11) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM ( 
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID 
				FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'')
				AND F40.NEXT_PARTFLOW IS NULL
			) REQPF
			LEFT JOIN
			(
				-- par les flux de transport
				SELECT PARTFLOW_ID, INDICATOR_EXPECTED_VALUE 
				FROM (
					SELECT PARTFLOW_ID, TRANSPORT_TERM, INCOTERM_CONDITIONS,
						CASE 
							WHEN INCOTERM_CONDITIONS IS NULL THEN 0
							-- If not any transport path but a PO AND primary logistic flow type is INTER_FACILITIES, indicator must be 1
							WHEN TRANSPORT_TERM IS NULL AND PRIMARY_LOGISTIC_FLOW_TYPE = ''INTER_FACILITIES'' AND INCOTERM_CONDITIONS = ''DEPART'' THEN 1
							-- If not any transport path but a PO, indicator must be 1
							WHEN TRANSPORT_TERM IS NULL THEN 1
							WHEN TRANSPORT_TERM = INCOTERM_CONDITIONS	THEN 1 
							ELSE 0 
						END AS INDICATOR_EXPECTED_VALUE
					FROM  (
					SELECT C01.PARTFLOW_ID, D01.TRANSPORT_TERM, 
					  CASE C02.INCOTERM
						WHEN ''CFR'' THEN ''FRANCO''
						WHEN ''CIF'' THEN ''FRANCO''
						WHEN ''CIP'' THEN ''FRANCO''
						WHEN ''CPT'' THEN ''FRANCO''
						WHEN ''DAF'' THEN ''FRANCO''
						WHEN ''DDP'' THEN ''FRANCO''
						WHEN ''DDU'' THEN ''FRANCO''
						WHEN ''DEQ'' THEN ''FRANCO''
						WHEN ''DES'' THEN ''FRANCO''
						WHEN ''EXW'' THEN ''DEPART''
						WHEN ''FAS'' THEN ''DEPART''
						WHEN ''FCA'' THEN ''DEPART''
						WHEN ''FH''  THEN ''FRANCO''
						WHEN ''FOB'' THEN ''DEPART''
						WHEN ''UN''  THEN ''FRANCO''
						WHEN ''ZFR'' THEN ''FRANCO''
						WHEN ''ZPU'' THEN ''FRANCO''
					  END as INCOTERM_CONDITIONS,
					F50.PRIMARY_LOGISTIC_FLOW_TYPE
					FROM KO2QTC01 C01
					LEFT JOIN KO2QTC02 C02 ON (C02.PO_LINE_ID = C01.ID AND C02.START_DATE <= SYSDATE AND (C02.END_DATE IS NULL OR C02.END_DATE > SYSDATE))          
					LEFT JOIN
					(
					  -- Only TRANSPORTPATHID for DIRECT:COMPLET and INDIRECT:UP
					  SELECT TRANSPORTPATH, PARTFLOW
					  FROM (
						SELECT PARTFLOW, CLASSNAME, TRANSPORTPATH
						, CASE 
						  WHEN TRANSPORTFLOWPIPEPARENT IS NOT NULL THEN ''I''
						  WHEN (SELECT COUNT(1) FROM KO2QTD02 D02 WHERE D02.TRANSPORTFLOWPIPEPARENT = D02C.ID) = 0 THEN ''D''
						  ELSE ''I''
						END AS TRANSPORTTYPE
						FROM KO2QTD02 D02C
						WHERE (D02C.ENDDATE IS NULL OR D02C.ENDDATE > SYSDATE)
					  ) req WHERE (transporttype = ''D'' AND CLASSNAME = ''COMPLET'') OR (transporttype = ''I'' AND CLASSNAME = ''UP'')
					) TP ON (C01.PARTFLOW_ID = TP.PARTFLOW) 
					LEFT JOIN KO2QTD01 D01 ON (D01.ID = TP.TRANSPORTPATH)
					LEFT JOIN KO2QTF40 F40 ON (F40.PARTFLOW_ID = C01.PARTFLOW_ID)
					LEFT JOIN KO2QTF50 F50 ON (F50.PRIMARY_LOGISTIC_FLOW_ID = F40.PRIMARY_LOGISTIC_FLOW)
					-- Only PO with lastest creation date
					WHERE (C01.PO_CREATION_DATE) IN (SELECT MAX(c01b.PO_CREATION_DATE) FROM KO2QTC01 c01b WHERE c01b.PARTFLOW_ID = C01.PARTFLOW_ID)
				  ) subreq
				) req
			) REQEX ON (REQPF.PARTFLOW_ID = REQEX.PARTFLOW_ID)
			LEFT JOIN
			(
				-- par les indicateurs de maturite
				SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				FROM KO2QTF71
				WHERE MATURITY_INDICATOR = 11
			) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	-- 12 - PREPARATION COMMUNICATION FLOW
	preparationcomflowindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 12) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM (
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'')
			) REQPF
			LEFT JOIN (
				-- From communication flows
				SELECT PARTFLOW, 
				  CASE 
					WHEN TRANSPORTTYPE = ''D'' AND NB = 1 THEN 1 
					WHEN TRANSPORTTYPE = ''I'' AND NB = 2 THEN 1 
					ELSE 0 
				  END AS INDICATOR_EXPECTED_VALUE 
				FROM(
				  SELECT D02.PARTFLOW, D02.TRANSPORTTYPE, COUNT(1) AS NB
				  FROM (
					SELECT ID, PARTFLOW, CLASSNAME, TRANSPORTPATH, STARTDATE, ENDDATE
					, CASE 
					  WHEN TRANSPORTFLOWPIPEPARENT IS NOT NULL THEN ''I''
					  WHEN (SELECT COUNT(1) FROM KO2QTD02 D02bis WHERE D02bis.TRANSPORTFLOWPIPEPARENT = D02C.ID) = 0 THEN ''D''
					  ELSE ''I''
					END AS TRANSPORTTYPE
					FROM KO2QTD02 D02C
					WHERE (D02C.ENDDATE IS NULL OR D02C.ENDDATE > SYSDATE)          
				  ) D02
				  JOIN KO2QTO11 O11 ON (O11.TRANSPORT_FLOW_PIPE = D02.ID)
				  JOIN KO2QTO09 O09 ON (O09.ID = O11.COM_FLOW_ID AND O09.FLOW_STATUS = ''V'' AND O09.COPY = 0)
				  JOIN KO2QTO06 O06 ON (O06.ID = O09.SENDER AND O06.MESSAGE_FUNCTION = ''DELFOR'')
				  WHERE D02.STARTDATE <= SYSDATE AND (D02.ENDDATE IS NULL OR D02.ENDDATE > SYSDATE)
				  GROUP BY PARTFLOW, TRANSPORTTYPE
				) req
			) REQEX ON (REQEX.PARTFLOW = REQPF.PARTFLOW_ID)
			LEFT JOIN (
				-- From maturity indicators
				SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				FROM KO2QTF71
				WHERE MATURITY_INDICATOR = 12
			) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	-- 13 - EXECUTION COMMUNICATION FLOW
	executioncomflowindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 13) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM (
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'')
			) REQPF
			LEFT JOIN (
        -- From communication flows
        SELECT PARTFLOW, 
          CASE 
            WHEN TRANSPORTTYPE = ''D'' AND NB = 2 THEN 1 
            WHEN TRANSPORTTYPE = ''I'' AND NB = 4 THEN 1 
            ELSE 0 
          END AS INDICATOR_EXPECTED_VALUE 
        FROM(
          SELECT D02.PARTFLOW, D02.TRANSPORTTYPE, COUNT(1) AS NB
          FROM (
            SELECT ID, PARTFLOW, CLASSNAME, TRANSPORTPATH, STARTDATE, ENDDATE
            , CASE 
              WHEN TRANSPORTFLOWPIPEPARENT IS NOT NULL THEN ''I''
              WHEN (SELECT COUNT(1) FROM KO2QTD02 D02bis WHERE D02bis.TRANSPORTFLOWPIPEPARENT = D02C.ID) = 0 THEN ''D''
              ELSE ''I''
            END AS TRANSPORTTYPE
            FROM KO2QTD02 D02C
            WHERE (D02C.ENDDATE IS NULL OR D02C.ENDDATE > SYSDATE)          
          ) D02
          JOIN KO2QTO11 O11 ON (O11.TRANSPORT_FLOW_PIPE = D02.ID)
          JOIN KO2QTO09 O09 ON (O09.ID = O11.COM_FLOW_ID AND O09.FLOW_STATUS = ''V'' AND O09.COPY = 0)
          JOIN KO2QTO06 O06 ON (O06.ID = O09.SENDER AND O06.MESSAGE_FUNCTION IN (''DELJIT'',''DESADV''))
          WHERE D02.STARTDATE <= SYSDATE AND (D02.ENDDATE IS NULL OR D02.ENDDATE > SYSDATE)
          GROUP BY PARTFLOW, TRANSPORTTYPE
        ) req
			) REQEX ON (REQEX.PARTFLOW = REQPF.PARTFLOW_ID)
			LEFT JOIN (
				-- From maturity indicators
				SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				FROM KO2QTF71
				WHERE MATURITY_INDICATOR = 13
			) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	-- 14 - FLUX PIECE SANS QUAI
	docksindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 14) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM (
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'') 
			) REQPF
			LEFT JOIN
			(
				-- par les quais
				SELECT F48.PARTFLOW AS PF_ID_EX, CASE WHEN COUNT(F48.PARTFLOW) >= 1 THEN 1 ELSE 0 END AS INDICATOR_EXPECTED_VALUE
				FROM KO2QTF48 F48
				WHERE F48.END_DATE IS NULL OR F48.END_DATE > SYSDATE
				GROUP BY F48.PARTFLOW
			) REQEX ON (REQPF.PARTFLOW_ID = REQEX.PF_ID_EX)
			LEFT JOIN
			(
				-- par les indicateurs de maturite
				SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				FROM KO2QTF71
				WHERE MATURITY_INDICATOR = 14
			) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	-- 15 - FLUX PIECE SANS CAT
	catsindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 15) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM ( 
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'') 
			) REQPF
			LEFT JOIN
			(
				-- par les flux de transport puis les cat
				SELECT D02.PARTFLOW AS PF_ID_EX, CASE WHEN COUNT(1) >= 1 THEN 1 ELSE 0 END AS INDICATOR_EXPECTED_VALUE
				FROM KO2QTD02 D02
				JOIN KO2QTM01 M01 ON (M01.TRANSPORT_PATH = D02.TRANSPORTPATH AND M01.DEFAULT_CAT = ''0'' and M01.DISCR <> ''DOWN''  AND M01.DELETED = ''0'' AND trunc(application_date, ''DDD'') <= sysdate)
				JOIN KO2QTF40 F40 ON (F40.PARTFLOW_ID = D02.PARTFLOW AND F40.SELLER = M01.SELLER)
				GROUP BY D02.PARTFLOW
			) REQEX ON (REQPF.PARTFLOW_ID = REQEX.PF_ID_EX)
			LEFT JOIN
			(
				-- par les indicateurs de maturite
				SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				FROM KO2QTF71
				WHERE MATURITY_INDICATOR = 15
			) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';

	-- 16 - FLUX PIECE AVEC CHEMIN DE TRANSPORT SANS PARAMETRE DE SECURITE
	transportsafetyindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT PARTFLOW, MATURITY_INDICATOR, CASE WHEN SUM(INDICATOR_EXPECTED_VALUE) >= 1 THEN 1 ELSE 0 END as INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
			FROM (
				SELECT REQPF.PARTFLOW, COALESCE(REQMI.MATURITY_INDICATOR, 16) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
				FROM (
					-- Only TRANSPORTPATHID for DIRECT:COMPLET and INDIRECT:UP
					SELECT TRANSPORTPATH, PARTFLOW
					FROM (
						SELECT PARTFLOW, CLASSNAME, TRANSPORTPATH
						, CASE 
						WHEN TRANSPORTFLOWPIPEPARENT IS NOT NULL THEN ''I''
						WHEN (SELECT COUNT(1) FROM KO2QTD02 D02 WHERE D02.TRANSPORTFLOWPIPEPARENT = D02C.ID) = 0 THEN ''D''
						ELSE ''I''
						END AS TRANSPORTTYPE
					FROM KO2QTD02 D02C
					WHERE (D02C.ENDDATE IS NULL OR D02C.ENDDATE > SYSDATE)
					) req WHERE (transporttype = ''D'' AND CLASSNAME = ''COMPLET'') OR (transporttype = ''I'' AND CLASSNAME = ''UP'')
				) REQPF
				LEFT JOIN (
					-- From parameters
					SELECT D02.TRANSPORTPATH, 
						   (SELECT CASE WHEN COUNT(1) >= 1 THEN 1 ELSE 0 END FROM KO2QTD10 D10 WHERE D10.TRANSPORT_PATH = D02.TRANSPORTPATH AND D10.DISCR = ''TRANS_SAFETY'' GROUP BY D02.TRANSPORTPATH) as INDICATOR_EXPECTED_VALUE
					FROM KO2QTD02 D02 
				) REQEX ON (REQEX.TRANSPORTPATH = REQPF.TRANSPORTPATH)
				LEFT JOIN (
					-- From maturity indicators
					SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
					FROM KO2QTF71
					WHERE MATURITY_INDICATOR = 16
				) REQMI ON (REQPF.PARTFLOW = REQMI.PF_ID_MI)
			)
			GROUP BY PARTFLOW, MATURITY_INDICATOR, INDICATOR_VALUE
		)
		GROUP BY PARTFLOW, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	-- 17 - FLUX PIECE AVEC CHEMIN DE TRANSPORT SANS PARAMETRE DE SECURITE DE DOUANES
	customssafetyindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT PARTFLOW, MATURITY_INDICATOR, CASE WHEN SUM(INDICATOR_EXPECTED_VALUE) >= 1 THEN 1 ELSE 0 END as INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
			FROM (
				SELECT REQPF.PARTFLOW, COALESCE(REQMI.MATURITY_INDICATOR, 17) as MATURITY_INDICATOR, COALESCE(REQEX.INDICATOR_EXPECTED_VALUE, 0) as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
				FROM (
					-- Only TRANSPORTPATHID for DIRECT:COMPLET and INDIRECT:UP
					SELECT TRANSPORTPATH, PARTFLOW
					FROM (
					  SELECT PARTFLOW, CLASSNAME, TRANSPORTPATH
					  , CASE 
						WHEN TRANSPORTFLOWPIPEPARENT IS NOT NULL THEN ''I''
						WHEN (SELECT COUNT(1) FROM KO2QTD02 D02 WHERE D02.TRANSPORTFLOWPIPEPARENT = D02C.ID) = 0 THEN ''D''
						ELSE ''I''
					  END AS TRANSPORTTYPE
					  FROM KO2QTD02 D02C
					  WHERE (D02C.ENDDATE IS NULL OR D02C.ENDDATE > SYSDATE)
					) req WHERE (transporttype = ''D'' AND CLASSNAME = ''COMPLET'') OR (transporttype = ''I'' AND CLASSNAME = ''DOWN'')
				) REQPF
				LEFT JOIN (
				  -- From parameters
				  SELECT D02.TRANSPORTPATH, 
						 (SELECT CASE WHEN COUNT(1) >= 1 THEN 1 ELSE 0 END FROM KO2QTD10 D10 WHERE D10.TRANSPORT_PATH = D02.TRANSPORTPATH AND D10.DISCR = ''CUSTOMS_SAFETY'' GROUP BY D02.TRANSPORTPATH) as INDICATOR_EXPECTED_VALUE
				  FROM KO2QTD02 D02 
				) REQEX ON (REQEX.TRANSPORTPATH = REQPF.TRANSPORTPATH)
				LEFT JOIN (
				  -- From maturity indicators
				  SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				  FROM KO2QTF71
				  WHERE MATURITY_INDICATOR = 17
				) REQMI ON (REQPF.PARTFLOW = REQMI.PF_ID_MI)
			)
			GROUP BY PARTFLOW, MATURITY_INDICATOR, INDICATOR_VALUE
		)
		GROUP BY PARTFLOW, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	-- 19 - VALIDATION MANUELLE : TOUS INDICATEURS SAUF LUI MEME A 1
	--  Recopie de la valeur actuelle !!!
	manualvalidationindicator VARCHAR2(10000) := '
		SELECT * FROM (
			SELECT REQPF.PARTFLOW_ID, COALESCE(REQMI.MATURITY_INDICATOR, 19) as MATURITY_INDICATOR, COALESCE(REQMI.INDICATOR_VALUE, ''0'') as INDICATOR_EXPECTED_VALUE, REQMI.INDICATOR_VALUE
			FROM (
				-- All PartFlows with status <> S
				SELECT F40.PARTFLOW_ID FROM KO2QTF40 F40
				JOIN KO2QTF45 F45 ON (F45.PARTFLOW_ID = F40.PARTFLOW_ID)
				WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
				AND F45.STATUS_CODE NOT IN (''S'') 
			) REQPF
			LEFT JOIN (
				-- From maturity indicators
				SELECT PART_FLOW_ID AS PF_ID_MI, MATURITY_INDICATOR, INDICATOR_VALUE
				FROM KO2QTF71
				WHERE MATURITY_INDICATOR = 19
			) REQMI ON (REQPF.PARTFLOW_ID = REQMI.PF_ID_MI)
		)
		GROUP BY PARTFLOW_ID, MATURITY_INDICATOR, INDICATOR_EXPECTED_VALUE, INDICATOR_VALUE
		ORDER BY 1
	';
	
	-- Maturity Indicator
	TYPE MATURITY_INDICATOR_TYPE IS RECORD (
		partflow_id					      NUMBER(19,0),
		maturity_indicator			  NUMBER(19,0),
		indicator_expected_value	CHAR(1 CHAR),
		indicator_value				    CHAR(1 CHAR)
	);

	TYPE MATURITY_INDICATOR_ARRAY IS VARRAY(32500) OF MATURITY_INDICATOR_TYPE;
	
	maturityIndicatorList MATURITY_INDICATOR_ARRAY := MATURITY_INDICATOR_ARRAY();
  
	/*
	 * Retrieve Maturity Indicators from a query.
	 */
	PROCEDURE CheckMaturityIndicators(p_query IN VARCHAR2)
	IS
		TYPE curtype IS REF CURSOR;
		l_src_cur curtype;
		l_thecursor	INTEGER DEFAULT dbms_sql.open_cursor;
		l_maturityIndicatorList MATURITY_INDICATOR_ARRAY := MATURITY_INDICATOR_ARRAY();
	BEGIN
		OPEN l_src_cur FOR p_query;
		FETCH l_src_cur BULK COLLECT INTO l_maturityIndicatorList;

		FOR i IN 1 .. l_maturityIndicatorList.COUNT LOOP
		  maturityIndicatorList.EXTEND;
		  maturityIndicatorList(maturityIndicatorList.count) := l_maturityIndicatorList(i);
		END LOOP;

		CLOSE l_src_cur;
	END;
  
	/*
	 * Stock indicators into table
	 */
	PROCEDURE StockMaturityIndicators(p_miList IN MATURITY_INDICATOR_ARRAY)
	IS
		maturityIndicator MATURITY_INDICATOR_TYPE;
	BEGIN
  
		FOR i IN 1 .. p_miList.COUNT LOOP
			maturityIndicator := p_miList(i);
			
			IF maturityIndicator.indicator_value IS NOT NULL THEN
			END IF;
		END LOOP;
	end;
  
	/* 
	 * Define functions
	 */
		/* 
	 * Repair maturity indicators
	 */
	PROCEDURE RepairMaturityIndicators
	IS
	BEGIN
		displayerrorsubtitle('Part Flow Maturity Indicators (KO2QTF71)');
    for rec in (select * from tmp_table where indicator_value <> indicator_expected_value order by 1, 2) loop
      displayCorrectionLine('U', ' KO2QTF71', 'partflow_id='|| rec.partflow_id || ' , maturity_indicator=' ||rec.maturity_indicator || ' , current_indicator_value=' ||rec.indicator_value || ' , expected_indicator_value=' ||rec.indicator_expected_value);
      UPDATE KO2QTF71 SET INDICATOR_VALUE = rec.indicator_expected_value, LAST_UPDATE_USER = 'RECALAGE' WHERE part_flow_id = rec.partflow_id AND maturity_indicator = rec.maturity_indicator;
    END LOOP;
	END;

  	/* 
	 * Repair partflow status
	 */
	PROCEDURE RepairPartflowStatus
	IS
	BEGIN
		displayerrorsubtitle('Part Flow Status (KO2QTF45)');
	    FOR rec IN (
	      SELECT partflow_id, partflow_current_status, partflow_expected_status
	      FROM TMP_TABLE
	      where partflow_current_status <> partflow_expected_status
	      GROUP BY partflow_id, partflow_current_status, partflow_expected_status
	      ORDER BY 1, 2
	    ) LOOP
	      displaycorrectionline('U', ' KO2QTF45', 'partflow_id='|| rec.partflow_id || ' , partflow_current_status=' ||rec.partflow_current_status || ' , partflow_expected_status=' ||rec.partflow_expected_status);
	      UPDATE KO2QTF45 SET STATUS_CODE = rec.partflow_expected_status, LAST_UPDATE_USER = 'RECALAGE' WHERE partflow_id = rec.partflow_id AND status_code = rec.partflow_current_status AND (START_DATE <= SYSDATE AND (END_DATE > SYSDATE OR END_DATE IS NULL));
	    END loop;
	END;




BEGIN

	DELETE FROM TMP_TABLE;

	--  1 - Nominal UC
	CheckMaturityIndicators(nominalucindicator);

	--  2 - Operational UA
	CheckMaturityIndicators(operationaluaindicator);	
	
	--  3 - Transport Paths
	CheckMaturityIndicators(transportpathsindicator);
	
	--  6 - Global Lead Time
	CheckMaturityIndicators(globalleadtimeindicator);
	
	--  7 - Lead time
	CheckMaturityIndicators(leadtimeindicator);
	
	-- Stock maturity incators into TMP_TABLE
	StockMaturityIndicators(maturityIndicatorList);
  
	-- Reinit array
	maturityIndicatorList := MATURITY_INDICATOR_ARRAY();
  
	--  8 - Order system
	CheckMaturityIndicators(ordersystemindicator);
		
	-- 9 - Repartition percentage
	CheckMaturityIndicators(repartitionpercentageindicator);
		
	-- 10 - Purchase order
	CheckMaturityIndicators(purchaseorderindicator);
	
	-- 11 - Incoterm transport condition
	CheckMaturityIndicators(incotermindicator);
	
	-- 12 - Preparation communication flow
	CheckMaturityIndicators(preparationcomflowindicator);
  
	-- Stock maturity incators into TMP_TABLE
	StockMaturityIndicators(maturityIndicatorList);

	-- Reinit array
	maturityIndicatorList := MATURITY_INDICATOR_ARRAY();
	
	-- 13 - Execution communication flow
	CheckMaturityIndicators(executioncomflowindicator);
	
	-- 14 - Docks
	CheckMaturityIndicators(docksindicator);
	
	-- 15 - Cats
	CheckMaturityIndicators(catsindicator);

	-- 16 - Transport safety
	CheckMaturityIndicators(transportsafetyindicator);
	
	-- 17 - Customs safety
	CheckMaturityIndicators(customssafetyindicator);
  
	-- 19 - Manual validation
	CheckMaturityIndicators(manualvalidationindicator);
    
	-- Stock maturity incators into TMP_TABLE
	StockMaturityIndicators(maturityIndicatorList);

  UPDATE TMP_TABLE tmp SET partflow_current_status = (
    SELECT status_code
    FROM ko2qtf45 f45
    WHERE (F45.START_DATE <= SYSDATE AND (F45.END_DATE IS NULL OR F45.END_DATE > SYSDATE))
	AND f45.PARTFLOW_ID = tmp.PARTFLOW_ID
  );

  UPDATE TMP_TABLE tmp SET partflow_expected_status = (
    SELECT EXPECTED_STATUS_CODE
    FROM (
      SELECT req.*, COALESCE(IS_D, IS_E, IS_P, 'I') as EXPECTED_STATUS_CODE
        FROM (    
          -- PartFlows with incorrect current status
          SELECT 
            f40.PARTFLOW_ID,
            REQPFS_PREV.ID AS PREV_STATUS_ID,
            REQPFS_PREV.STATUS_CODE AS PREV_STATUS_CODE, 
            REQPFS_CURR.ID as CURR_STATUS_ID, 
            REQPFS_CURR.STATUS_CODE AS CURR_STATUS_CODE, 
            REQPFS_CURR.START_DATE AS CURR_START_DATE, 
            REQPFS_CURR.END_DATE AS CURR_END_DATE, 
            REQPFS_NEXT.ID AS NEXT_STATUS_ID,
            REQPFS_NEXT.STATUS_CODE AS NEXT_STATUS_CODE, 
            CASE WHEN NB_IND_E = TOTAL_IND_E THEN 'E' ELSE NULL END AS IS_E,
            CASE WHEN NB_IND_P = TOTAL_IND_P THEN 'P' ELSE NULL END AS IS_P,
            CASE 
              WHEN EXISTS (
                  SELECT 1
                  FROM ko2qtf41 f41
                  JOIN ko2qtf41 f41b ON (f41b.partflow_id = f41.partflow_id AND f41b.ROLE = 'PROPOSED' AND f41b.LOG_DISTRIB_PERCENTAGE = 0 AND (f41b.start_date <= SYSDATE AND (f41b.end_date IS NULL OR f41b.end_date > SYSDATE)))
                  WHERE f41.ROLE = 'ACTIVE' AND f41.LOG_DISTRIB_PERCENTAGE = 0
                  AND (f41.start_date <= SYSDATE AND (f41.end_date IS NULL OR f41.end_date > SYSDATE))
                  AND f41.partflow_id = f40.PARTFLOW_ID
              ) THEN 'D'
              WHEN EXISTS (
                  SELECT 1
                  FROM ko2qtp50 p50
                  WHERE p50.LOGISTIC_BUILD_OUT_DATE < SYSDATE
                  AND p50.LOGISTIC_BUILD_OUT_DATE IS NOT NULL
                  AND p50.ID = f40.PRODUCT_EXTERNAL_PLACE
              ) THEN 'D'
              ELSE NULL
            END as IS_D,          
            REQP.NB_IND_P, 
            REQP.TOTAL_IND_P, 
            REQE.NB_IND_E, 
            REQE.TOTAL_IND_E
          FROM ko2qtf40 f40
          JOIN
          (
            SELECT id, partflow_id, status_code, start_date, end_date
            FROM ko2qtf45 f45 
            WHERE (start_date <= SYSDATE AND (end_date IS NULL OR end_date > SYSDATE))
            AND f45.status_code NOT IN ('S', 'D')
            GROUP BY id, partflow_id, status_code, start_date, end_date
            HAVING COUNT(1) = 1
          ) REQPFS_CURR ON (REQPFS_CURR.partflow_id = f40.partflow_id)
          -- Get previous status
          LEFT JOIN
          (
            SELECT id, partflow_id, status_code, start_date, end_date  FROM ko2qtf45 f45 
          ) REQPFS_PREV ON (REQPFS_PREV.partflow_id = REQPFS_CURR.partflow_id AND REQPFS_PREV.end_date = REQPFS_CURR.start_date)
          -- Get next status
          LEFT JOIN
          (
            SELECT id, partflow_id, status_code, start_date, end_date  FROM ko2qtf45 f45 
          ) REQPFS_NEXT ON (REQPFS_NEXT.partflow_id = REQPFS_CURR.partflow_id AND REQPFS_NEXT.start_date = REQPFS_CURR.end_date)
          -- Get P lines
          JOIN 
          (
            SELECT tmp.partflow_id, SUM(indicator_expected_value) as nb_ind_p, COUNT(1) as total_ind_p
            FROM tmp_table tmp
            JOIN ko2qtf70 f70 ON (f70.ID = tmp.maturity_indicator AND f70.is_preparation = 1)
            GROUP BY tmp.partflow_id
          ) REQP ON (REQP.partflow_id = REQPFS_CURR.partflow_id)
          -- Get E lines  
          JOIN 
          (
            SELECT tmp.partflow_id, SUM(indicator_expected_value) as nb_ind_e, COUNT(1) as total_ind_e
            FROM tmp_table tmp
            JOIN ko2qtf70 f70 ON (f70.ID = tmp.maturity_indicator)
            GROUP BY tmp.partflow_id
          ) REQE ON (REQE.partflow_id = REQPFS_CURR.partflow_id)
      ) req
    ) req2
    WHERE req2.PARTFLOW_ID = tmp.PARTFLOW_ID
  );
  
	/* 
	 * Now launch process
	 */
		RepairMaturityIndicators;
	RepairPartflowStatus;



  
END;


Begin
	displayErrorFirstSeparator();
END;


END;
