		WHERE tl02Ua.start_date < tl01uc.version_start_date OR tl02Ua.end_date > tl01uc.version_end_date
	';
	
	-- PrimaryLogisticFlow
	primaryLogisticFlows VARCHAR2(10000) := '
		Select Primary_Logistic_Flow_Id
		from ko2qtf50 f50
		where primary_logistic_flow_type like ''INTER%''
