	-- PartsListFlowPEP
	partsListFlows VARCHAR2(10000) := '
		Select Id From Ko2qtf01 F01 Where F01.Consumer_Sgr_Code Not In
		(Select Code From Ko2qtt02 T02 Where T02.Cu In
			(Select Code From Ko2qtt02 Tt02 Where Tt02.External_Place In
				(SELECT EXTERNAL_PLACE_ID FROM KO2QTP50 p50 WHERE p50.PRODUCT_ID in
