	';
	
	-- PartsListFlowPEP2
	partsListFlowPEP2s VARCHAR2(10000) := '
		Select Id From (
			SELECT p53.type_of, f01.id
			From Ko2qtf01 F01
			Join Ko2qtf02 F02 On F01.Article_Id = F02.Id
			Join Ko2qtt02 Sgr On F01.Consumer_Sgr_Code = Sgr.Code
			Join Ko2qtt02 Cu On Sgr.Cu = Cu.Code
			Join Ko2qtp50 P50 On (P50.External_Place_Id = Cu.External_Place And F02.Product_Id = P50.Product_Id)
			Left Join Ko2qtp53 P53 On P50.Id = P53.Product_External_Place AND p53.type_of IN (''INFRA_DAILY_NON_BALANCED_SAFETY'',''SUPPLYING_REQUIREMENT'',''PLANNING_SAFETY'')
			Group By (P53.Type_Of, F01.Id)
		) Req
		GROUP BY (id)
		having Count(1) < 3
