		JOIN KO2QTF45 tf45 ON tf45.partflow_id = tf40.partflow_id AND tf45.status_code = ''S''
		JOIN KO2QTF60 tf60 ON tf60.partflow_id = tf40.partflow_id
		JOIN KO2QTF01 tf01 ON tf01.id = tf60.partslistflow_id
		JOIN KO2QTF02 tf02 ON tf02.id = tf01.article_id
		JOIN kO2QTT02 tt02c ON tt02c.code = tf01.consumer_sgr_code
		JOIN kO2QTT02 tt02m ON tt02m.code = tf02.id_manufacturer_sgr 
		WHERE tf01.fn_type <> ''S''
		OR (tf01.fn_type <> ''S'' AND tt02c.cu <> tt02m.cu)
