			Join Ko2qta12 A12 On (F44.Manufacturer_Id = A12.Externalplaceid And A12.Partnerfunction = ''MANUFACTURER'')
			Join KO2QTA06 a06 On (a06.FIRST_ACTOR_ID = f40.SELLER AND a06.SECOND_ACTOR_ID = F44.Manufacturer_Id AND a06.CONTRACT_RELATIONSHIP_TYPE = ''DF'')
			Join Ko2qtf50 F50 On F50.Primary_Logistic_Flow_Id = F40.Primary_Logistic_Flow
			Join KO2QTA06 aa06 On (f50.CONSIGNEE = aa06.second_actor_id AND aa06.CONTRACT_RELATIONSHIP_TYPE = ''MC'' AND aa06.FIRST_ACTOR_ID = F44.Manufacturer_Id)
            Where Ko2qtf40.Classname = ''PartFlow''
