			SELECT G03.CONTACT_ID
			FROM ko2qtg01 G01
			JOIN ko2qtg03 G03 ON (G03.CONTACT_ID = G01.ID AND G03.CONTACT_FUNCTION = ''APP'')
			WHERE G01.CONTACT_TYPE = ''PSA''
		) contacts
		LEFT JOIN (
			SELECT G02.CONTACT_ID, COUNT(1) as nbArea
			FROM KO2QTG02 G02
			JOIN KO2QTF76 F76 ON (F76.ID = G02.AREA_ID AND F76.DEFAULT_AREA = ''1'')
			WHERE G02.DISCR = ''R''
			GROUP BY G02.CONTACT_ID
		) contactArea ON (contacts.CONTACT_ID = contactArea.CONTACT_ID)
		WHERE nbArea IS NULL OR nbArea <> 1
		ORDER BY 1
	';
	
	-- Areas must have only one procurement contact
	AreasProcurementContact VARCHAR2(10000) := '
		SELECT F76.ID
		FROM KO2QTF76 F76
		LEFT JOIN (
			SELECT G02.AREA_ID, COUNT(1) AS nbContact
			FROM KO2QTG02 G02
			JOIN ko2qtg01 G01 ON (g01.ID = g02.contact_id AND G01.CONTACT_TYPE = ''PSA'')
			JOIN ko2qtg03 G03 ON (G03.CONTACT_ID = G02.CONTACT_ID AND G03.CONTACT_FUNCTION = ''APP'')
			WHERE G02.DISCR = ''R''
			GROUP BY G02.AREA_ID
		) areaContact ON (F76.ID = areaContact.AREA_ID)
		WHERE nbContact IS NULL OR nbContact <> 1
		ORDER BY 1
	';
	
	-- Percentage of local distribution must be equal to the sum of percentage logistic distribution of all locals logistic flow
	LocalDistributionPercentage VARCHAR2(10000) := '
		SELECT req.*, LOCAL_DISTRIBUTION_RATIO
		FROM
		(
		  SELECT p50.id, sum(f41.log_distrib_percentage) as EXPECTED_LOCAL_DISTRIB_RATIO
		  FROM ko2qtp50 p50
		  JOIN ko2qtf40 f40 on p50.id = f40.product_external_place
		  JOIN ko2qtf50 f50 on (f50.primary_logistic_flow_id = f40.primary_logistic_flow and f50.local_long_distance = ''LOCAL'')
		  JOIN ko2qtf41 f41 on (f41.partflow_id = f40.partflow_id AND f41.role = ''ACTIVE'')
		  WHERE f41.start_date <= sysdate and (f41.end_date > sysdate or f41.end_date is null)
		  group by p50.id
		) req
		JOIN ko2qtp51 p51 on (p51.product_external_place = req.id and p51.start_date <= sysdate and (p51.end_date > sysdate or p51.end_date is null))
		WHERE EXPECTED_LOCAL_DISTRIB_RATIO <> LOCAL_DISTRIBUTION_RATIO
		ORDER BY 1
	';
	
Begin

	displayErrorSubtitle('Checking various data ...');

	CheckErrorsInQuery(partflows, 'Parflow with missing parameters');

	CheckErrorsInQuery(partflows2, 'Parflow product don t correspond to his PartsListFlow product');

	CheckErrorsInQuery(partflows3, 'Parflow seller and shipper has not a contractRelationship FM');

	CheckErrorsInQuery(PartFlowsUaDates, 'PartFlows With Ua Dates Out Of Uc Dates');
	
	CheckErrorsInQuery(primaryLogisticFlows, 'PrimaryLogisticFlow INTER consignee or shipper is not a usercenter');

	CheckErrorsInQuery(primaryLogisticFlows2, 'PrimaryLogisticFlow with no PartFlow');

	CheckErrorsInQuery(partflowpackings, 'ParflowPacking with no operationalUa');

	CheckErrorsInQuery(purchaseOrderLines, 'Purchase Order Line with no current state');

	CheckErrorsInQuery(transportPaths, 'TransportPath COMPLET with no PrimaryLogisticFlow');

	CheckErrorsInQuery(transportPaths2, 'TransportPath consignee not in path');

	CheckErrorsInQuery(transportPathParams, 'TransportPath with more than 1 same param in the same time');

	CheckErrorsInQuery(internalPlayingPlaces, 'InternalFlowPipe with no PlayingPlace');

	CheckErrorsInQuery(pais, 'More than 1 PartnerAdministrativeInformation for the same externalPlace in the same time');

	CheckErrorsInQuery(userCenters, 'UserCenter with less or more than 4 category');

	CheckErrorsInQuery(lines, 'Line with no or more than 2 GatePoints');

	CheckErrorsInQuery(partsListFlows, 'PartsListFlow with no ProductExternalPlace');

	CheckErrorsInQuery(partsListFlowPEP2s, 'PartsListFlow with ProductExternalPlace with missing Parameters');

	CheckErrorsInQuery(ParListFlowIntra, 'Intra PartListFlows with incorrect PartList (type) or with manufacturer and cusumer on different CU');
	
	/* CheckErrorsInQuery(PurchaseOrderLines2, 'PurchaseOrderLineState quota different sum from 1 for the same ProductExternalPlace'); */

	/* CheckErrorsInQuery(Weightings, 'Interpreted weighting sum different from 1 for the same ProductExternalPlace')); */

