	CheckErrorsInQuery(ExternalPlaceWithoutCofor, 'External place without any Cofor');
	
	CheckErrorsInQuery(LocalDistributionPercentage, 'Percentage of local distribution must be equal to the sum of percentage logistic distribution of all locals logistic flow');
    
END;




DECLARE
  -- Record
  TYPE SEGMENT_TYPE IS RECORD (
    ID_INTERNAL_PATH          KO2QTI02.ID_INTERNAL_PATH%TYPE,
    INTERNAL_SEGMENT_ID       KO2QTI03.INTERNAL_SEGMENT_ID%TYPE,
    SOURCE_INTERNAL_PLACE_ID  KO2QTI04.SOURCE_INTERNAL_PLACE_ID%TYPE,
    TARGET_INTERNAL_PLACE_ID  KO2QTI04.TARGET_INTERNAL_PLACE_ID%TYPE
  );

  -- Retrieve list of internel paths
  CURSOR INTERNAL_PATH_CURSOR IS
    Select DISTINCT TI02.ID_INTERNAL_PATH as ID From KO2QTI02 ti02
  ;

  -- Retrieve list of segments for one internal path
  CURSOR SEGMENTS_CURSOR(internal_path IN NUMBER) IS
    Select TI02.ID_INTERNAL_PATH, TI03.INTERNAL_SEGMENT_ID, ti04.SOURCE_INTERNAL_PLACE_ID, ti04.TARGET_INTERNAL_PLACE_ID
    From KO2QTI02 ti02
    join KO2QTI03 ti03 ON (ti03.INTERNAL_PATH_ID = TI02.ID_INTERNAL_PATH)
    join KO2QTI04 ti04 ON (ti04.internal_segment_id = ti03.internal_segment_id)
    where TI02.ID_INTERNAL_PATH = internal_path
  ;

  -- Retrieve head of internal path segments
  CURSOR HEAD_SEGMENTS_CURSOR(internal_path IN NUMBER) IS
    Select req.*  from
    (
      Select TI02.ID_INTERNAL_PATH, TI03.INTERNAL_SEGMENT_ID, ti04.SOURCE_INTERNAL_PLACE_ID, ti04.TARGET_INTERNAL_PLACE_ID
      From KO2QTI02 ti02
      join KO2QTI03 ti03 ON (ti03.INTERNAL_PATH_ID = TI02.ID_INTERNAL_PATH)
      join KO2QTI04 ti04 ON (ti04.internal_segment_id = ti03.internal_segment_id)
    ) req
	join KO2QTT01 tt01 ON (tt01.ID_INTERNAL_PLACE = req.SOURCE_INTERNAL_PLACE_ID AND tt01.WRAP_TYPE = 'DOCK' )
    WHERE req.ID_INTERNAL_PATH = internal_path
    AND
      req.SOURCE_INTERNAL_PLACE_ID NOT IN (
        Select ti04.TARGET_INTERNAL_PLACE_ID
        From KO2QTI03 ti03 
        join KO2QTI04 ti04 ON (ti04.internal_segment_id = ti03.internal_segment_id)
        WHERE ti03.INTERNAL_PATH_ID = req.ID_INTERNAL_PATH
      )
  ;
  
  -- Retrieve tail of internal path segments
  CURSOR TAIL_SEGMENTS_CURSOR(internal_path IN NUMBER) IS
    Select req.*  from
    (
      Select TI02.ID_INTERNAL_PATH, TI03.INTERNAL_SEGMENT_ID, ti04.SOURCE_INTERNAL_PLACE_ID, ti04.TARGET_INTERNAL_PLACE_ID
      From KO2QTI02 ti02
      join KO2QTI03 ti03 ON (ti03.INTERNAL_PATH_ID = TI02.ID_INTERNAL_PATH)
      join KO2QTI04 ti04 ON (ti04.internal_segment_id = ti03.internal_segment_id)
    ) req
	join KO2QTT01 tt01 ON (tt01.ID_INTERNAL_PLACE = req.TARGET_INTERNAL_PLACE_ID AND tt01.WRAP_TYPE = 'LINE' )
    WHERE req.ID_INTERNAL_PATH = internal_path
    AND
      req.TARGET_INTERNAL_PLACE_ID NOT IN (
        Select ti04.SOURCE_INTERNAL_PLACE_ID
        From KO2QTI03 ti03 
        join KO2QTI04 ti04 ON (ti04.internal_segment_id = ti03.internal_segment_id)
        WHERE ti03.INTERNAL_PATH_ID = req.ID_INTERNAL_PATH
      )
    ;
  
  -- Retrieve head of internal path segments
  CURSOR NEXT_SEGMENT_CURSOR(internal_path IN NUMBER, segment_id IN NUMBER, target_place_id IN NUMBER) IS
    Select TI02.ID_INTERNAL_PATH, TI03.INTERNAL_SEGMENT_ID, ti04.SOURCE_INTERNAL_PLACE_ID, ti04.TARGET_INTERNAL_PLACE_ID
    From KO2QTI02 ti02
    join KO2QTI03 ti03 ON (ti03.INTERNAL_PATH_ID = TI02.ID_INTERNAL_PATH)
    join KO2QTI04 ti04 ON (ti04.internal_segment_id = ti03.internal_segment_id)
    where TI02.ID_INTERNAL_PATH = internal_path
    and ti04.SOURCE_INTERNAL_PLACE_ID = target_place_id
  ;
  
  -- Records table
  TYPE SEGMENTS_ARRAY IS VARRAY(1000) OF SEGMENT_TYPE;
  TYPE PATH_ARRAY IS VARRAY(1000) OF NUMBER(6,0);

  myerrors PATH_ARRAY := PATH_ARRAY();
  internalpathsegments SEGMENTS_ARRAY;
  internalpathvalid SEGMENTS_ARRAY;
  
  myseg SEGMENT_TYPE;
  mynextseg SEGMENT_TYPE;
  
  nbCur PLS_INTEGER;
  nbMax PLS_INTEGER;
  nbErr PLS_INTEGER;
  nbValid PLS_INTEGER;
  
  hasTail BOOLEAN;
  
  hasNext BOOLEAN;
  hasError BOOLEAN;
  
BEGIN
  nbErr := 0;
  
  FOR internal_path IN INTERNAL_PATH_CURSOR LOOP
  
    internalpathsegments := SEGMENTS_ARRAY();
    internalpathvalid := SEGMENTS_ARRAY();
    
    nbCur := 0;
    nbValid := 0;
  
    hasTail := false;
  
    --DBMS_OUTPUT.PUT_LINE ('////////////////////////////////////////////');
    --DBMS_OUTPUT.PUT_LINE ('INTERNAL PATH ID : '||internal_path.ID);  
    
    /*
     * Check that path have a tail
     */
    OPEN TAIL_SEGMENTS_CURSOR(internal_path.ID);
    LOOP
      FETCH TAIL_SEGMENTS_CURSOR INTO myseg;
      EXIT WHEN TAIL_SEGMENTS_CURSOR%NOTFOUND;
      EXIT WHEN TAIL_SEGMENTS_CURSOR%ROWCOUNT <> 1;
      hasTail := true;
    END LOOP;
    CLOSE TAIL_SEGMENTS_CURSOR;
    
    IF hasTail THEN
         
      /*
       * Get list of segments for this internal path
       */
      OPEN SEGMENTS_CURSOR(internal_path.ID);
      LOOP
        FETCH SEGMENTS_CURSOR INTO myseg;
        EXIT WHEN SEGMENTS_CURSOR%NOTFOUND;
        
        --DBMS_OUTPUT.PUT_LINE ('--- SEGMENT FOUND #'||myseg.INTERNAL_SEGMENT_ID);
        
        nbCur := nbCur + 1;
        internalpathsegments.extend;   
        internalpathsegments(nbCur) := myseg;
        
      END LOOP;
      CLOSE SEGMENTS_CURSOR;
          
      /*
       * Get HEAD segment in list
       */
      OPEN HEAD_SEGMENTS_CURSOR(internal_path.ID);
      LOOP
        FETCH HEAD_SEGMENTS_CURSOR INTO myseg;
        EXIT WHEN HEAD_SEGMENTS_CURSOR%NOTFOUND;
      
        --DBMS_OUTPUT.PUT_LINE ('+++ HEAD SEGMENT : ' || myseg.ID_INTERNAL_PATH || ' ' || myseg.INTERNAL_SEGMENT_ID || ' ' || myseg.SOURCE_INTERNAL_PLACE_ID || ' ' || myseg.TARGET_INTERNAL_PLACE_ID);
      
        /*
         * Follow segment path
         */
        Loop
        
          -- Add myseg to validsegments
          nbValid := nbValid + 1;
          internalpathvalid.extend;
          internalpathvalid(nbValid) := myseg;
          
          hasNext := false;
          
          -- Replace myseg with next segment
          OPEN NEXT_SEGMENT_CURSOR(myseg.ID_INTERNAL_PATH ,myseg.INTERNAL_SEGMENT_ID, myseg.TARGET_INTERNAL_PLACE_ID);
          LOOP
            FETCH NEXT_SEGMENT_CURSOR INTO mynextseg;
            EXIT WHEN NEXT_SEGMENT_CURSOR%NOTFOUND;
            EXIT WHEN NEXT_SEGMENT_CURSOR%ROWCOUNT <> 1;
          
            hasNext := true;
            myseg := mynextseg;
          
            --DBMS_OUTPUT.PUT_LINE ('+++ NEXT SEGMENT : ' || myseg.ID_INTERNAL_PATH || ' ' || myseg.INTERNAL_SEGMENT_ID || ' ' || myseg.SOURCE_INTERNAL_PLACE_ID || ' ' || myseg.TARGET_INTERNAL_PLACE_ID);
          
          END LOOP;
          CLOSE NEXT_SEGMENT_CURSOR;
        
        EXIT WHEN NOT hasNext;
        End loop;
      
        EXIT;
      
      END LOOP;
      CLOSE HEAD_SEGMENTS_CURSOR;
    
    END IF;
    
    -- Check errors
    hasError := false;
  
    IF internalpathsegments.count <> internalpathvalid.count THEN
      hasError := true;
    END IF;
    
    IF internalpathsegments.count < 1 THEN
      hasError := true;
    END IF;
    
    IF hasError THEN
      nbErr := nbErr + 1;
      myerrors.extend;
      myerrors(nbErr) := internal_path.ID;
    END IF;
    
  END LOOP;
  
  /*
   * Print errors
   */
  displayErrorSubtitle('Checking Inconsistency of Internal path segments ...');
   
  FOR i IN 1..myerrors.count Loop
    displayErrorRow(i, 'ID_INTERNAL_PATH', 'Inconsistency in the list of segments for Internal Path');
  End loop ;
  
  -- SUMUP
  
END;




DECLARE
  -- Record
  TYPE SEGMENT_TYPE IS RECORD (
    ID_TRANSPORT_PATH          KO2QTD01.ID%TYPE,
    TRANSPORT_SEGMENT_ID       KO2QTD09.SEGMENT%TYPE,
    SOURCE_TRANSPORT_PLACE_ID  KO2QTD03.SOURCE%TYPE,
    TARGET_TRANSPORT_PLACE_ID  KO2QTD03.TARGET%TYPE
  );

  -- Retrieve list of internel paths
  CURSOR transport_path_CURSOR IS
    Select DISTINCT TD01.ID as ID From KO2QTD01 td01
  ;

  -- Retrieve list of segments for one transport path
  CURSOR SEGMENTS_CURSOR(transport_path IN NUMBER) IS
    Select TD01.ID, TD09.SEGMENT, TD03.SOURCE, TD03.TARGET
    From KO2QTD01 td01
    join KO2QTD09 TD09 ON (TD09.TRANSPORTPATH = TD01.ID)
    join KO2QTD03 TD03 ON (TD03.ID = TD09.SEGMENT)
    where TD01.ID = transport_path
  ;

  -- Retrieve head of transport path segments
  CURSOR HEAD_SEGMENTS_CURSOR(transport_path IN NUMBER) IS
    Select req.*  from
    (
      Select TD01.ID, TD09.SEGMENT, TD03.SOURCE, TD03.TARGET
      From KO2QTD01 td01
      join KO2QTD09 TD09 ON (TD09.TRANSPORTPATH = TD01.ID)
      join KO2QTD03 TD03 ON (TD03.ID = TD09.SEGMENT)
    ) req
    WHERE req.ID = transport_path
    AND
      req.SOURCE NOT IN (
        Select TD03.TARGET
        From KO2QTD09 TD09 
        join KO2QTD03 TD03 ON (TD03.ID = TD09.SEGMENT)
        WHERE TD09.TRANSPORTPATH = req.ID
      )
  ;
  
  -- Retrieve tail of transport path segments
  CURSOR TAIL_SEGMENTS_CURSOR(transport_path IN NUMBER) IS
    Select req.*  from
    (
      Select TD01.ID, TD09.SEGMENT, TD03.SOURCE, TD03.TARGET
      From KO2QTD01 td01
      join KO2QTD09 TD09 ON (TD09.TRANSPORTPATH = TD01.ID)
      join KO2QTD03 TD03 ON (TD03.ID = TD09.SEGMENT)
    ) req
	  WHERE req.ID = transport_path
    AND
      req.TARGET NOT IN (
        Select TD03.SOURCE
        From KO2QTD09 TD09 
        join KO2QTD03 TD03 ON (TD03.ID = TD09.SEGMENT)
        WHERE TD09.TRANSPORTPATH = req.ID
      )
    ;
  
  -- Retrieve head of transport path segments
  CURSOR NEXT_SEGMENT_CURSOR(transport_path IN NUMBER, segment_id IN NUMBER, target_place_id IN NUMBER) IS
    Select TD01.ID, TD09.SEGMENT, TD03.SOURCE, TD03.TARGET
    From KO2QTD01 td01
    join KO2QTD09 TD09 ON (TD09.TRANSPORTPATH = TD01.ID)
    join KO2QTD03 TD03 ON (TD03.ID = TD09.SEGMENT)
    where TD01.ID = transport_path
    and TD03.SOURCE = target_place_id
  ;
  
  -- Records table
  TYPE SEGMENTS_ARRAY IS VARRAY(1000) OF SEGMENT_TYPE;
  TYPE PATH_ARRAY IS VARRAY(1000) OF NUMBER(6,0);

  myerrors PATH_ARRAY := PATH_ARRAY();
  transportpathsegments SEGMENTS_ARRAY;
  transportpathvalid SEGMENTS_ARRAY;
  
  myseg SEGMENT_TYPE;
  mynextseg SEGMENT_TYPE;
  
  nbCur PLS_INTEGER;
  nbMax PLS_INTEGER;
  nbErr PLS_INTEGER;
  nbValid PLS_INTEGER;
  
  hasTail BOOLEAN;
  
  hasNext BOOLEAN;
  hasError BOOLEAN;
  
BEGIN
  nbErr := 0;
  
  FOR transport_path IN transport_path_CURSOR LOOP
  
    transportpathsegments := SEGMENTS_ARRAY();
    transportpathvalid := SEGMENTS_ARRAY();
    
    nbCur := 0;
    nbValid := 0;
  
    hasTail := false;
  
    --DBMS_OUTPUT.PUT_LINE ('////////////////////////////////////////////');
    --DBMS_OUTPUT.PUT_LINE ('TRANSPORT PATH ID : '||transport_path.ID);  
    
    /*
     * Check that path have a tail
     */
    OPEN TAIL_SEGMENTS_CURSOR(transport_path.ID);
    LOOP
      FETCH TAIL_SEGMENTS_CURSOR INTO myseg;
      EXIT WHEN TAIL_SEGMENTS_CURSOR%NOTFOUND;
      EXIT WHEN TAIL_SEGMENTS_CURSOR%ROWCOUNT <> 1;
      hasTail := true;
    END LOOP;
    CLOSE TAIL_SEGMENTS_CURSOR;
    
    IF hasTail THEN
         
      /*
       * Get list of segments for this transport path
       */
      OPEN SEGMENTS_CURSOR(transport_path.ID);
      LOOP
        FETCH SEGMENTS_CURSOR INTO myseg;
        EXIT WHEN SEGMENTS_CURSOR%NOTFOUND;
        
        --DBMS_OUTPUT.PUT_LINE ('--- SEGMENT FOUND #'||myseg.TRANSPORT_SEGMENT_ID);
        
        nbCur := nbCur + 1;
        transportpathsegments.extend;   
        transportpathsegments(nbCur) := myseg;
        
      END LOOP;
      CLOSE SEGMENTS_CURSOR;
          
      /*
       * Get HEAD segment in list
       */
      OPEN HEAD_SEGMENTS_CURSOR(transport_path.ID);
      LOOP
        FETCH HEAD_SEGMENTS_CURSOR INTO myseg;
        EXIT WHEN HEAD_SEGMENTS_CURSOR%NOTFOUND;
      
        --DBMS_OUTPUT.PUT_LINE ('+++ HEAD SEGMENT : ' || myseg.ID_TRANSPORT_PATH || ' ' || myseg.TRANSPORT_SEGMENT_ID || ' ' || myseg.SOURCE_TRANSPORT_PLACE_ID || ' ' || myseg.TARGET_TRANSPORT_PLACE_ID);
      
        /*
         * Follow segment path
         */
        Loop
        
          -- Add myseg to validsegments
          nbValid := nbValid + 1;
          transportpathvalid.extend;
          transportpathvalid(nbValid) := myseg;
          
          hasNext := false;
          
          -- Replace myseg with next segment
          OPEN NEXT_SEGMENT_CURSOR(myseg.ID_TRANSPORT_PATH ,myseg.TRANSPORT_SEGMENT_ID, myseg.TARGET_TRANSPORT_PLACE_ID);
          LOOP
            FETCH NEXT_SEGMENT_CURSOR INTO mynextseg;
            EXIT WHEN NEXT_SEGMENT_CURSOR%NOTFOUND;
            EXIT WHEN NEXT_SEGMENT_CURSOR%ROWCOUNT <> 1;
          
            hasNext := true;
            myseg := mynextseg;
          
            --DBMS_OUTPUT.PUT_LINE ('+++ NEXT SEGMENT : ' || myseg.ID_TRANSPORT_PATH || ' ' || myseg.TRANSPORT_SEGMENT_ID || ' ' || myseg.SOURCE_TRANSPORT_PLACE_ID || ' ' || myseg.TARGET_TRANSPORT_PLACE_ID);
          
          END LOOP;
          CLOSE NEXT_SEGMENT_CURSOR;
        
        EXIT WHEN NOT hasNext;
        End loop;
      
        EXIT;
      
      END LOOP;
      CLOSE HEAD_SEGMENTS_CURSOR;
    
    END IF;
    
    -- Check errors
    hasError := false;
  
    IF transportpathsegments.count <> transportpathvalid.count THEN
      hasError := true;
    END IF;
    
    IF transportpathsegments.count < 1 THEN
      hasError := true;
    END IF;
    
    IF hasError THEN
      nbErr := nbErr + 1;
      myerrors.extend;
      myerrors(nbErr) := transport_path.ID;
    END IF;
    
  END LOOP;
  
  /*
   * Print errors
   */
  displayErrorSubtitle('Checking Inconsistency of Transport path segments ...');
   
  FOR i IN 1..myerrors.count Loop
    displayErrorRow(i, 'ID_TRANSPORT_PATH', 'Inconsistency in the list of segments for Transport Path');
  End loop ;
  
  -- SUMUP
  
END;


Begin
	displayErrorsSumUp();
END;


END;
