DECLARE
	globalErrorCount integer := 0;

	/*
	 * Display an error line.
	 */
	procedure displayErrorLine(line IN STRING) IS
	begin
		dbms_output.put_line(' * ' || line);
	end;

		/*
	 * Display an error line.
	 */
	procedure displayCorrectionLine(theType IN STRING, theTable IN STRING, line IN STRING) IS
	begin
		displayErrorLine('[' || theType || '] ' || theTable || ' : ' || line);
	end;
	
	/*
	 * Display an error separator into a block.
	 */
	procedure displayErrorSeparator IS
	begin
		dbms_output.put_line(' *' || rpad(' ', 100, '-') || ' * ');
	end;

		/*
	 * Display an error separator into a block.
	 */
	procedure displaySeparator IS
	begin
		dbms_output.put_line(' *' || rpad(' ', 100, '.') || ' * ');
	end;
	
	/*
	 * Display an error separator between blocks.
	 */
	procedure displayErrorFirstSeparator IS
	begin
		dbms_output.put_line('/*' || rpad(' ', 100, '*') || ' */');
	end;

	/*
	 * Display the formatted block title.
	 */
	procedure displayErrorTitle(title IN STRING) IS
	begin
		displayErrorFirstSeparator();
		displayErrorLine('********* ' || rpad(title, 79) || ' ********* *');
		displayErrorFirstSeparator();
	end;
	
	/*
	 * Display the formatted block subtitle.
	 */
	procedure displayErrorSubtitle(title IN STRING) IS
	begin
		displayErrorSeparator();
		displayErrorLine('---- ' || rpad(title, 94) || ' *');
		displaySeparator();
	end;

	/*
	 * Display and format an error with the object ID and the message.
	 */
	procedure displayErrorRow(objectId IN varchar2, colname IN VARCHAR2, message IN VARCHAR2) IS
	begin
		globalErrorCount := globalErrorCount + 1;
		displayErrorLine('Error ' || lpad(globalErrorCount, 3) || ' : ' || message || ' - ' || colname || '[' || objectId || ']');
	end;

	/*
	 * Display a sumup of all previous errors.
	 */
	procedure displayErrorsSumUp IS
	begin
		displayErrorSeparator();
		displayErrorSeparator();
		If globalErrorCount = 0 Then
			displayErrorLine('          :-D OK -> No errors found.');
		Else
			displayErrorLine('          /!\ KO -> ' || globalErrorCount || ' errors found !!!');
		End if;
		displayErrorFirstSeparator();
	end;

	/*
	 * Check errors from a query.
	 *   - The query must return only 1 field (The ID of objects in error)
	 *   - The message is the error description
	 */
	procedure CheckErrorsInQuery( p_query IN varchar2, p_message IN varchar2 )
	IS
		l_theCursor     integer DEFAULT dbms_sql.open_cursor;
		l_columnValue   varchar2(4000);
		l_status        integer;
		l_descTbl       dbms_sql.desc_tab;
		l_colCnt        number;
	begin
		dbms_sql.parse( l_theCursor, p_query, dbms_sql.native );
		dbms_sql.describe_columns( l_theCursor, l_colCnt, l_descTbl );

		FOR i IN 1 .. l_colCnt loop
			dbms_sql.define_column(l_theCursor, i, l_columnValue, 4000);
		end loop;

		l_status := dbms_sql.execute(l_theCursor);

		while ( dbms_sql.fetch_rows(l_theCursor) > 0 ) loop
			dbms_sql.column_value( l_theCursor, 1, l_columnValue );
			displayErrorRow( l_columnValue, l_descTbl(1).col_name, p_message );
		end loop;
    
		dbms_sql.close_cursor(l_theCursor);
	end;


BEGIN
DECLARE

    /* Define the structure */
    TYPE RESULT_TYPE IS RECORD (
      table_name					      VARCHAR2(20),
      key_val1		              VARCHAR2(50),
      key_val2		              VARCHAR2(50),
      key_val3		              VARCHAR2(50),
      key_val4		              VARCHAR2(50),
      lines_count             	INTEGER,
      lines_checked  				    INTEGER
    );

    /* Define the structure */
    TYPE CHECK_STRUCTURE_TYPE IS RECORD (
      table_name					      VARCHAR2(20),
      key_column1			          VARCHAR2(50),
      key_column2			          VARCHAR2(50),
      key_column3			          VARCHAR2(50),
      key_column4			          VARCHAR2(50),
      start_column             	VARCHAR2(50),
      end_column    				    VARCHAR2(50),
      restrictions              VARCHAR2(500)
    );
    
    /* Define the period */
    TYPE PERIOD_TYPE IS RECORD (
      key_val1			        VARCHAR2(50),
      key_val2			        VARCHAR2(50),
      key_val3			        VARCHAR2(50),
      key_val4			        VARCHAR2(50),
      start_val            	DATE,
      end_val    				    DATE
    );
    
    /* Just init the structure */
    FUNCTION CreateCheckStructure(table_name IN VARCHAR2, key_column1 IN VARCHAR2, key_column2 IN VARCHAR2, key_column3 IN VARCHAR2, key_column4 IN VARCHAR2, start_column IN VARCHAR2, end_column IN VARCHAR2, restrictions IN VARCHAR2)
    RETURN CHECK_STRUCTURE_TYPE
    IS
      currentStructure CHECK_STRUCTURE_TYPE;
    BEGIN
      currentStructure.table_name := table_name;
      currentStructure.key_column1 := key_column1;
      currentStructure.key_column2 := key_column2;
      currentStructure.key_column3 := key_column3;
      currentStructure.key_column4 := key_column4;
      currentStructure.start_column := start_column;
      currentStructure.end_column := end_column;
      currentStructure.restrictions := restrictions;
      
      RETURN currentStructure;
    END;
    
    /* Get first period */
    FUNCTION getFirstPeriod(check_structure IN CHECK_STRUCTURE_TYPE, keyval1 IN VARCHAR2, keyval2 IN VARCHAR2, keyval3 IN VARCHAR2, keyval4 IN VARCHAR2)
    RETURN PERIOD_TYPE
    IS
      refcursor   SYS_REFCURSOR;
      period      PERIOD_TYPE;
      request     VARCHAR2(5000);
    BEGIN
    
      request := 'SELECT req.* FROM (SELECT CAST('||check_structure.key_column1||' as VARCHAR2(50)) AS '||check_structure.key_column1;
                            
      IF check_structure.key_column2 IS NOT NULL THEN
        request := request||',CAST('||check_structure.key_column2||' as VARCHAR2(50)) AS '||check_structure.key_column2;
      ELSE
        request := request||', null as col2';
      END IF;
      IF check_structure.key_column3 IS NOT NULL THEN
        request := request||',CAST('||check_structure.key_column3||' as VARCHAR2(50)) AS '||check_structure.key_column3;
      ELSE
        request := request||', null as col3';
      END IF;
      IF check_structure.key_column4 IS NOT NULL THEN
        request := request||',CAST('||check_structure.key_column4||' as VARCHAR2(50)) AS '||check_structure.key_column4;
      ELSE
        request := request||', null as col4';
      END IF;
                            
      request := request||','||check_structure.start_column||','||check_structure.end_column||' FROM '||check_structure.table_name||' WHERE '||check_structure.key_column1||'='''||keyval1||'''';
      
      IF check_structure.key_column2 IS NOT NULL THEN
        request := request||' AND '||check_structure.key_column2||'='''||keyval2||'''';
      END IF;
      IF check_structure.key_column3 IS NOT NULL THEN
        request := request||' AND '||check_structure.key_column3||'='''||keyval3||'''';
      END IF;
      IF check_structure.key_column4 IS NOT NULL THEN
        request := request||' AND '||check_structure.key_column4||'='''||keyval4||'''';
      END IF;
      
      IF check_structure.restrictions IS NOT NULL THEN
        request := request||' AND '||check_structure.restrictions;
      END IF;
        
      request := request||' ORDER BY '||check_structure.start_column||') req WHERE ROWNUM=1';
  
      OPEN refcursor FOR request;
      FETCH refcursor INTO period;
	  CLOSE refcursor;
      return period;
  
    END;
    
     /* Get next period */
    FUNCTION getNextPeriod(check_structure IN CHECK_STRUCTURE_TYPE, keyval1 IN VARCHAR2, keyval2 IN VARCHAR2, keyval3 IN VARCHAR2, keyval4 IN VARCHAR2, previousPeriod IN PERIOD_TYPE)
    RETURN PERIOD_TYPE
    IS
      refcursor   SYS_REFCURSOR;
      period      PERIOD_TYPE;
      request     VARCHAR2(5000);
    BEGIN

      request := 'SELECT CAST('||check_structure.key_column1||' as VARCHAR2(50)) AS '||check_structure.key_column1;
      
      IF check_structure.key_column2 IS NOT NULL THEN
        request := request||',CAST('||check_structure.key_column2||' as VARCHAR2(50)) AS '||check_structure.key_column2;
      ELSE
        request := request||', null as col2';
      END IF;
      IF check_structure.key_column3 IS NOT NULL THEN
        request := request||',CAST('||check_structure.key_column3||' as VARCHAR2(50)) AS '||check_structure.key_column3;
      ELSE
        request := request||', null as col3';
      END IF;
      IF check_structure.key_column4 IS NOT NULL THEN
        request := request||',CAST('||check_structure.key_column4||' as VARCHAR2(50)) AS '||check_structure.key_column4;
      ELSE
        request := request||', null as col4';
      END IF;
      
      request := request||','||check_structure.start_column||','||check_structure.end_column||' FROM '||check_structure.table_name||' WHERE '||check_structure.key_column1||'='''||keyval1||'''';
      
      IF check_structure.key_column2 IS NOT NULL THEN
        request := request||' AND '||check_structure.key_column2||'='''||keyval2||'''';
      END IF;
      IF check_structure.key_column3 IS NOT NULL THEN
        request := request||' AND '||check_structure.key_column3||'='''||keyval3||'''';
      END IF;
      IF check_structure.key_column4 IS NOT NULL THEN
        request := request||' AND '||check_structure.key_column4||'='''||keyval4||'''';
      END IF;
      
      IF check_structure.restrictions IS NOT NULL THEN
        request := request||' AND '||check_structure.restrictions;
      END IF;
      
      request := request||' AND '||check_structure.start_column||'=to_date('''||to_char(previousPeriod.end_val,'yyyy-MM-dd HH24:MI:SS')||''', ''yyyy-MM-dd HH24:MI:SS'') ORDER BY '||check_structure.start_column;
	
      OPEN refcursor FOR request;
      FETCH refcursor INTO period;
	  CLOSE refcursor;
      return period;
  
    END;
    
    /* Launch process for structure */
    PROCEDURE CheckDateContinuity(check_structure IN CHECK_STRUCTURE_TYPE)
    IS
    
        refcursor           SYS_REFCURSOR;
        current_result      RESULT_TYPE;
        current_period      PERIOD_TYPE;
        request             VARCHAR2(5000);
        message             VARCHAR2(5000);
    
    BEGIN
	
		displayErrorSubtitle('Table ' || check_structure.table_name);
		
        request := 'SELECT '''||check_structure.table_name||''','||check_structure.key_column1;
        
        IF check_structure.key_column2 IS NOT NULL THEN
          request := request||', '||check_structure.key_column2;
        ELSE
          request := request||', null as col2';
        END IF;
        IF check_structure.key_column3 IS NOT NULL THEN
          request := request||', '||check_structure.key_column3;
        ELSE
          request := request||', null as col3';
        END IF;
        IF check_structure.key_column4 IS NOT NULL THEN
          request := request||', '||check_structure.key_column4;
        ELSE
          request := request||', null as col4';
        END IF;
                    
        request := request||', COUNT(1),0 '||'FROM '||check_structure.table_name||' WHERE '||check_structure.key_column1||' IS NOT NULL';
        
        IF check_structure.key_column2 IS NOT NULL THEN
          request := request||' AND '||check_structure.key_column2||' IS NOT NULL';
        END IF;
        IF check_structure.key_column3 IS NOT NULL THEN
          request := request||' AND '||check_structure.key_column3||' IS NOT NULL';
        END IF;
        IF check_structure.key_column4 IS NOT NULL THEN
          request := request||' AND '||check_structure.key_column4||' IS NOT NULL';
        END IF;
        
        IF check_structure.restrictions IS NOT NULL THEN
          request := request||' AND '||check_structure.restrictions;
        END IF;
                    
        request := request||' GROUP BY '||check_structure.key_column1;
        
        IF check_structure.key_column2 IS NOT NULL THEN
          request := request||', '||check_structure.key_column2;
        END IF;
        IF check_structure.key_column3 IS NOT NULL THEN
          request := request||', '||check_structure.key_column3;
        END IF;
        IF check_structure.key_column4 IS NOT NULL THEN
          request := request||', '||check_structure.key_column4;
        END IF;
                    
        OPEN refcursor FOR request;
        LOOP
            FETCH refcursor INTO current_result;
            EXIT WHEN refcursor%NOTFOUND;
                       
            current_period := getFirstPeriod(check_structure, current_result.key_val1, current_result.key_val2, current_result.key_val3, current_result.key_val4);
           
            message := check_structure.table_name||' WHERE '||check_structure.key_column1||'='''||current_result.key_val1||'''';
            IF check_structure.key_column2 IS NOT NULL THEN message := message||' AND '||check_structure.key_column2||'='''||current_result.key_val2||''''; END IF;
            IF check_structure.key_column3 IS NOT NULL THEN message := message||' AND '||check_structure.key_column3||'='''||current_result.key_val3||''''; END IF;
            IF check_structure.key_column4 IS NOT NULL THEN message := message||' AND '||check_structure.key_column4||'='''||current_result.key_val4||''''; END IF;
            IF check_structure.restrictions IS NOT NULL THEN message := message||' AND '||check_structure.restrictions; END IF;
           
              -- Detect some ANOMALYs
            IF current_period.start_val IS NULL THEN
              displayErrorLine('First period hasn''t start date : '||message);
            ELSE
           
              LOOP
                -- Detect infinite loop
                IF current_result.lines_checked > 100 THEN
                  displayErrorLine('Infinite loop : '||message);
                  EXIT;
                END IF;
              
                -- Detect some ANOMALYs
                IF current_period.start_val IS NULL THEN
                  displayErrorLine('Discontinuous sequence : '||message);
                  EXIT;
                END IF;
                
                -- Detect start = end
                IF current_period.start_val = current_period.end_val THEN
                  displayErrorLine('Period with same start_date and end_date : '||message);
                  EXIT;
                END IF;
                                
                -- Increment counter for this KEY
                current_result.lines_checked := current_result.lines_checked + 1;
              
                -- EXIT IF infinity end date
                EXIT WHEN current_period.end_val IS NULL OR current_period.end_val > to_date('2050-12-31','yyyy-MM-dd');
                
                -- Get next period and loop
                current_period := getNextPeriod(check_structure, current_result.key_val1, current_result.key_val2, current_result.key_val3, current_result.key_val4, current_period);
                
              END LOOP;
              
              -- Finally check counters
              IF current_result.lines_count <> current_result.lines_checked THEN
                displayErrorLine('Too much periods : '||current_result.lines_count||' counted and only '||current_result.lines_checked||' contiguous : '||message);
              END IF;
            
            END IF;
            
        END LOOP;
		CLOSE refcursor;
    END;

BEGIN

	displayErrorTitle('Checking periods continuity ...');
		
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTA02', 'EXTERNALPLACEID', NULL, NULL, NULL, 'STARTDATEVALIDITY', 'ENDDATEVALIDITY', null));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTA17', 'LISSAGE_PARAMETERS', NULL, NULL, NULL, 'START_DATE', 'END_DATE', NULL));
    --CheckDateContinuity(CreateCheckStructure('KO2.KO2QTA33', 'PARTNER_MODIFICATION', NULL, NULL, NULL, 'START_DATE', 'END_DATE', null));
    
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTC02', 'PO_LINE_ID', NULL, NULL, NULL, 'START_DATE', 'END_DATE', null));
    
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTD02', 'PARTFLOW', 'CLASSNAME', NULL, NULL, 'STARTDATE', 'ENDDATE', null));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTD10', 'TRANSPORT_PATH', 'DISCR', NULL, NULL, 'START_DATE', 'END_DATE', null));
    
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTF07', 'PARTS_LIST_FLOW_ID', NULL, NULL, NULL, 'START_DATE', 'END_DATE', null));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTF41', 'PARTFLOW_ID', 'ROLE', NULL, NULL, 'START_DATE', 'END_DATE', NULL));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTF42', 'PART_FLOW_ID', 'SGR_ID', NULL, NULL, 'START_DATE', 'END_DATE', null));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTF44', 'PARTFLOW_ID', 'PARTNER_FUNCTION', NULL, NULL, 'START_DATE', 'END_DATE', NULL));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTF45', 'PARTFLOW_ID', NULL, NULL, NULL, 'START_DATE', 'END_DATE', 'STATUS_CODE<>''S'''));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTF48', 'PARTFLOW', 'DOCK', NULL, NULL, 'START_DATE', 'END_DATE', NULL));
       
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTL01', 'PARTFLOW_PACKING_ID', null, NULL, NULL, 'VERSION_START_DATE', 'VERSION_END_DATE', NULL));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTL02', 'PARTFLOW_PACKING_ID', null, null, null, 'START_DATE', 'END_DATE', 'CLASS_NAME=''OperationalUa'''));
    
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTP51', 'PRODUCT_EXTERNAL_PLACE', NULL, NULL, NULL, 'START_DATE', 'END_DATE', NULL));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTP53', 'PRODUCT_EXTERNAL_PLACE', 'SGR', 'LINE', 'TYPE_OF', 'APPLICATION_START_DATE', 'APPLICATION_END_DATE', 'TYPE_OF=''INFRA_DAILY_NON_BALANCED_SAFETY'''));
    
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTT10', 'SGR_ID', NULL, NULL, NULL, 'APPLICATION_START_DATE', 'APPLICATION_END_DATE', null));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTT17', 'SLICING_ID', NULL, NULL, NULL, 'APPLICATION_START_DATE', 'APPLICATION_END_DATE', null));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTT20', 'LINE_ID', NULL, NULL, NULL, 'VALIDITY_START_DATE', 'VALIDITY_END_DATE', null));
    CheckDateContinuity(CreateCheckStructure('KO2.KO2QTT28', 'LINE_ID', NULL, NULL, NULL, 'VALIDITY_START_DATE', 'VALIDITY_END_DATE', NULL));

	displayErrorSeparator();
	displayErrorSeparator();
	displayErrorLine('End of the continuity periods check');
    displayErrorFirstSeparator();
    
END; 


END;
/

